	"P0021": {
		"zzs": "Alle autofabrikanten",
		"dm": "P0021",
		"des": "Een nokkenaspositie - Timing te geavanceerd of systeemprestaties (bank 2)",
		"sys": "Brandstof-, lucht- of emissieregeling",
		"zs": "De rol van de nokkenas is het regelen van het openen en sluiten van de klep. In het variabele kleptimingsysteem verandert de elektronische nokkenasregelklep (of olieregelklep, OCV) de De hoek van de nokkenas wordt aangepast door middel van oliedruk naar de nokkenasversteller (mechanisch type) om ervoor te zorgen dat de klep op het optimale moment opent en sluit De storingsoorzaken van P0021 zijn onder meer een inlaat/linker/voorste nokkenastiming niet ingesteld Het zit vast, de nokkenas zit mechanisch vast of de actuatorklep zit vast in de open stand."
	},
	"P02B0": {
		"zzs": "Alle autofabrikanten",
		"dm": "P02B0",
		"des": "Cilinder 6 - Injector beperkt",
		"sys": "Brandstof of lucht",
		"zs": "De functie van de injector is om de brandstof te vernevelen zodat deze voldoet aan de vereisten van verbranding. Het werkingsprincipe is dat wanneer de elektromagnetische spoel wordt bekrachtigd, er zuigkracht wordt gegenereerd, de naaldklep wordt opgezogen, het mondstukgat wordt geopend en de brandstof gaat door de kop van de naaldklep.De ringvormige opening tussen de schachtnaald en het mondstukgat van het onderdeel wordt met hoge snelheid gespoten om een nevel te vormen.De elektronische besturingseenheid regelt de hoeveelheid brandstofinjectie door de openingstijdsinterval (ook wel de pulsbreedte genoemd) van de brandstofinjector. Deze foutcode geeft aan dat de prestatiefout van de injector van de zesde cilinder is."
	},
