		"zs": "De rol van de antidiefstalregeleenheid is ervoor te zorgen dat de auto alleen mag starten als de speciale sleutel aanwezig is en deze overeenkomt met de verschillende componenten. De motorregeleenheid, ook wel motorregeleenheid genoemd (de motorregeleenheid op sommige auto's) Het is geïntegreerd met de transmissieregelmodule om de aandrijflijnregelmodule te worden), die de werking van de gehele motor regelt. Zijn belangrijkste functie is het regelen van de optimale hoeveelheid brandstofinjectie en ontstekingstijdstip van de motor. Een andere belangrijke rol is het bewaken van de uitlaatemissiecontrole. onderdelen."
