		"zs": "De functie van de krukas is om de op en neergaande beweging van de zuiger om te zetten in een roterende beweging. De krukaspositiesensor (CKP) (ook wel de bovenste dode punt genoemd) wordt gebruikt om het bovenste dode punt te detecteren (BDP) signaal en het krukashoeksignaal En het motortoerentalsignaal, en voer het in de computer in, zodat de computer het beste ontstekingstijdstipcommando kan geven volgens de ontstekingsvolgorde van de cilinders. Als de elektronische regeleenheid (ECU) een fout detecteert in de spanning van de krukassensor A circuit, zal deze foutcode verschijnen."
