		"sys": "computer of hulpuitgangscircuit",
		"zs": "De motorregeleenheid, ook wel motorregeleenheid genoemd (sommige ingebouwde motorregelmodules en transmissieregelmodules zijn geïntegreerd in een regelmodule voor de aandrijflijn), bestuurt de werking van de gehele motor. De belangrijkste functie is om de De optimale hoeveelheid brandstofinjectie en ontstekingstijdstip voor de motor te regelen.Een andere belangrijke rol is het onderdeel dat verantwoordelijk is voor het bewaken van de uitlaatemissiecontrole.De Transmission Control Module (TCM of TCU) helpt de transmissie te beslissen wanneer en hoe te schakelen naar laat de auto de prestaties verbeteren, soepel schakelen en brandstofverbruik besparen.Deze foutcode geeft aan dat de circuitspanning van de interne temperatuursensor van de regelmodule buiten het gekalibreerde maximale bereik ligt.De oorzaak van de fout is de interne temperatuursensor, het circuit, de connector, of besturingsmodule."
