		"zs": "Het verdampingsemissiesysteem (EVAP) leidt benzinedampen van de brandstoftank naar een opslagtank met actieve kool die benzinedampen absorbeert. De motor gebruikt vervolgens frisse lucht om deze benzinedampen in de verbrandingskamer van de motor te spoelen. Als Wanneer de elektronische besturingseenheid (ECU) detecteert dat de spanning van het regelcircuit van de spoeling van het verdampingsemissiesysteem van de solenoïdeklep het normale kalibratiebereik overschrijdt, de foutcode zal verschijnen.De storingsoorzaken zijn onder meer circuitstoring van de actuator van de spoeling van het verdampingsemissiesysteem, storing van de spoelregelklep, elektronische besturing module (PCM of ECM) defect, etc."
