		"zs": "De functie van de oliedruksensor is om de oliedruk in de vorm van een elektrisch signaal naar de elektronische regeleenheid (ECU) te sturen. Bij onvoldoende druk zal de ECU een alarmsignaal op de instrumentenpaneel. Als de elektronische regeleenheid (ECU) detecteert dat de signaalspanning van de oliedruksensor hoger is dan 4,9 volt, verschijnt deze foutcode. De oorzaken van de storing zijn de oliedruksensor, het circuit, de connectoren en elektronische regeleenheid (ECU)."
