	"P065B": {
		"zzs": "Alle autofabrikanten",
		"dm": "P065B",
		"des": "Generator Regelcircuit Bereik/Prestaties",
		"sys": "computer of hulpuitgangscircuit",
		"zs": "De elektronische regeleenheid (ECU) bestuurt de generator via het generatorstartsignaalcircuit. Wanneer de generator moet draaien, stuurt de ECU een 5V-signaal naar de spanningsregelaar via het generatorstartsignaalcircuit. Na ontvangst van dit signaal , de spanningsregelaar begint het veldcircuit van de generator te regelen. Als het foutdetectiecircuit constateert dat de spanning van het openingscircuit van de generator niet correct is, verschijnt de foutcode. De spanningsregelaar kan ook een fout detecteren en de foutcode weergeven .Oorzaken van storingen zijn onder meer generatoren, circuits, connectoren of elektronische besturingseenheden."
	},
