		"des": "PCM/ECM/TCU Interne temperatuursensor A circuit laag",
		"sys": "computer of hulpuitgangscircuit",
		"zs": "De motorregeleenheid, ook wel motorregeleenheid genoemd (sommige ingebouwde motorregelmodules en transmissieregelmodules zijn geïntegreerd in een regelmodule voor de aandrijflijn), bestuurt de werking van de gehele motor. De belangrijkste functie is om de De optimale hoeveelheid brandstofinjectie en ontstekingstijdstip voor de motor te regelen.Een andere belangrijke rol is het onderdeel dat verantwoordelijk is voor het bewaken van de uitlaatemissiecontrole.De Transmission Control Module (TCM of TCU) helpt de transmissie te beslissen wanneer en hoe te schakelen zodat dat de auto de prestaties kan verbeteren, soepel kan schakelen en brandstofverbruik kan besparen.Deze foutcode geeft aan dat de circuitspanning van de interne temperatuursensor van de regelmodule lager is dan de gekalibreerde minimumwaarde.De oorzaak van de fout is de interne temperatuursensor, het circuit, de connector of besturingsmodule."
