		"des": "Uitlaatgasrecirculatiesensor C Circuit Bereik/Prestaties",
		"sys": "Emissiecontrole",
		"zs": "De rol van het uitlaatgasrecirculatiesysteem (EGR) is om een kleine hoeveelheid uitlaatgas in het inlaatspruitstuk te leiden wanneer de motor onder hoge belasting draait. De aanwezigheid van deze uitlaatgassen verlaagt de temperatuur en druk van de verbrandingskamer, waardoor de vervuiling door stikstofoxide wordt verminderd. Deze storingscode verschijnt als de elektronische regeleenheid (ECU) een fout detecteert in de signaalspanning van de uitlaatgasrecirculatiesensor (EGR)."
