		"des": "Turbocompressor/supercharger omloopklep regelcircuit laag",
		"sys": "Brandstof-, lucht- of emissieregeling",
		"zs": "De turbocompressor gebruikt het traagheidsmomentum van het uitlaatgas dat uit de motor komt om de turbine aan te drijven, die op zijn beurt de coaxiale waaier aandrijft om de inlaatlucht onder druk te zetten, waardoor het vermogen van de auto toeneemt. De supercharger is een supercharger gebruikt om het vermogen van de verbrandingsmotor te vergroten. Inlaatluchtcompressor. Meer inlaatlucht zorgt voor meer zuurstof naar de motor, waardoor de regeleenheid meer brandstof kan leveren, waardoor het uitgangsvermogen toeneemt. De rol van de supercharger-bypassklep is wanneer de vuldruk overschrijdt Wanneer het groot is, opent u de omloopklep om een deel van de hogedruklucht vrij te geven, om het doel te bereiken om de aanjager en de motor te beschermen.Deze foutcode geeft aan dat de spanning van de turbo / aanjager omleidingsklepregeling circuit lager is dan de minimumwaarde van de kalibratie."
