		"des": "Catalyst Temperatuur Sensor Circuit Bereik/Prestaties (Bank 1, Sensor 1)",
		"sys": "Emissiecontrole",
		"zs": "Een katalysator (ook wel katalysator genoemd) is een apparaat voor het zuiveren van uitlaatgassen dat de werking van een katalysator gebruikt om CO, HC en NOx in de uitlaat om te zetten in gassen die onschadelijk zijn voor het menselijk lichaam. vóór de uitlaatdemper in de uitlaatpijp. Deze storingscode geeft een fout aan in het circuit van de temperatuursensor van de katalysator. Oorzaken zijn onder meer een storing in de temperatuursensor, het circuit, de connectoren of de elektronische regeleenheid (ECU) van de katalysator."
