	"P0107": {
		"zzs": "Alle autofabrikanten",
		"dm": "P0107",
		"des": "Spuitstuk absolute druk/luchtdruk circuit laag",
		"sys": "Brandstof of lucht",
		"zs": "De Manifold Absolute Pressure (MAP)-sensor meet de druk (vacuüm) in het inlaatspruitstuk. De Powertrain Control Module (PCM) past vervolgens het verschil aan tussen de druk in het inlaatspruitstuk en de atmosferische druk. Het verschil (lineaire relatie met de motor belasting) wordt gebruikt als basis voor het bepalen van de basisbrandstofinjectiehoeveelheid van de injector om de motor te helpen de beste lucht-brandstofverhouding te bereiken onder verschillende belastingen. De barometrische druksensor (ook wel hoogtecompensator, HAC genoemd) wordt gebruikt om barometrische druk als een elektrisch signaal naar de elektronische regelmodule. De luchtdruk varieert met het weer en de hoogte. Hoe lager de druk, hoe dunner de lucht. De Powertrain Control Module (PCM) De waarde van de druk om de brandstoftoevoer te corrigeren om de motor de beste lucht-brandstofverhouding bereiken.Als de elektronische regeleenheid (ECU) detecteert dat de signaalspanning van de spruitstuk absolute druk (MAP) sensor/luchtdruksensor lager is dan de gekalibreerde lage waarde, verschijnt deze foutcode. MAP- of luchtdruksensor (BARO) sensorsignaalcircuit open of kortsluiting naar aarde, spanningsreferentiecircuit (VREF) open, sensorstoring of elektronische regelmodule (PCM of ECM) storing, etc."
	},
