		"des": "Hybride Accu Stroom Sensor A Circuit",
		"sys": "Hybride systeem",
		"zs": "De batterijcontrolemodule bewaakt het laden en ontladen van de batterij via het signaal van de batterijstroomsensor. Als de controlemodule constateert dat het signaalcircuit van de batterijstroomsensor defect is, zal deze foutcode verschijnen."
