		"zs": "De functie van het hybride batterijspanningsbewakingscircuit is om de spanning van het batterijblok naar de besturingsmodule te sturen om het laden en ontladen van het batterijblok te bewaken, evenals mogelijke kortsluiting en open circuitcondities ."
