		"des": "B nokkenasprofiel regelcircuit hoog (bank 2)",
		"sys": "Brandstof-, lucht- of emissieregeling",
		"zs": "De rol van de nokkenas is het regelen van het openen en sluiten van de klep. In het variabele kleptimingsysteem verandert de elektronische nokkenasregelklep (of olieregelklep, OCV) de De hoek van de nokkenas wordt aangepast door middel van oliedruk naar de nokkenasversteller (mechanisch) om ervoor te zorgen dat de klep op het optimale moment opent en sluit. Dit optimaliseert de efficiëntie en het vermogen van de motor in alle toerentallen. Deze DTC geeft B (Uitlaat/Rechts/Achter) nokkenas aan De spanning van het profielbesturingscircuit is hoger dan het gekalibreerde maximum."
