		"zs": "De Transmission Control Module (TCM of TCU) helpt de transmissie te beslissen wanneer en hoe er moet worden geschakeld door informatie te verzamelen van verschillende sensoren en de motorregeleenheid om de prestaties van de auto te verbeteren, soepel te schakelen en brandstof te besparen. de rol van het relais van de regelmodule is om de stroom naar de regelmodule te blijven behouden nadat de contactschakelaar is uitgeschakeld totdat de regelmodule het afsluitproces voltooit."
