		"sys": "Brandstof of lucht",
		"zs": "Brandstofafstelling is wanneer de elektronische regeleenheid (ECU) de brandstoftoevoer regelt door de openingstijd van de injectoren te verlengen of te verkorten, zodat de motor de optimale lucht-brandstofverhouding bereikt (14,7:1 lucht-benzinemassa verhouding) .De lucht-brandstofverhouding is te rijk betekent dat de brandstoftoevoer te groot is, en de lucht-brandstofverhouding is te mager betekent dat de brandstoftoevoer te klein is.Als het adaptieve brandstofregelsysteem de compensatielimiet heeft bereikt, en de lucht-brandstofverhouding is nog steeds erg rijk, deze foutcode Storingsoorzaken zijn onder meer inlaatluchtstroomsensor of spruitstuk absolute druk (MAP) sensorstoring, brandstofdruk te hoog, storing brandstofdrukregelaar, storing brandstofinjector, storing zuurstofsensor, timing nokkenas fout, olie te hoog vol, fout in verdampingsemissiesysteem, storing elektronische regelmodule (PCM of ECM), enz."
