		"sys": "Brandstof-, lucht- of emissieregeling",
		"zs": "De functie van de brandstofkoeler is om de brandstoftemperatuur te verlagen en daardoor de viscositeit van de zwavelarme diesel te verhogen. Deze storingscode geeft aan dat de spanning van het regelcircuit van de brandstofkoelerpomp hoger is dan de gekalibreerde maximumwaarde."
