		"des": "O2-sensorcircuit Geen activiteit gedetecteerd (bank 1, sensor 3)",
		"sys": "Brandstof of lucht",
		"zs": "De functie van de zuurstofsensor is om het zuurstofgehalte in het uitlaatgas van de motor te meten om de hoeveelheid brandstofinjectie te corrigeren, zodat de motor de beste lucht-brandstofverhouding kan verkrijgen. In de OBD-foutcode, u zult vaak het aantal rijen en nummers zien Zuurstofsensor Rij 1 verwijst naar de rij waar cilinder 1 zich bevindt, en de resterende rij is rij 2. Ongeacht welke rij, de eerste sensor verwijst altijd naar de stroomopwaartse zuurstofsensor (vóór de katalytische tank), verwijst de 2e sensor altijd naar de stroomafwaartse zuurstofsensor (na de katalytische tank). De elektronische regeleenheid (ECU) bewaakt continu de verwarmde zuurstofsensor en heeft vastgesteld dat de zuurstofsensor werkt. Als de signaalwaarde van de verwarmde zuurstofsensor blijft op de standaardwaarde, de ECU (ECU) stuurt de oscillerende lucht/brandstofverhouding aan in een poging enige verandering in de signaalwaarde te detecteren.Als de ECU de verandering in het sensorsignaal op dit moment nog steeds niet kan detecteren , verschijnt de storingscode."
