		"zs": "De rol van de omvormer is het omzetten van gelijkstroom in wisselstroom. De hybride elektronische besturingseenheid (HV ECU) gebruikt een in de omvormer geïntegreerde temperatuursensor om de temperatuur van de aandrijfmotoromvormer te bewaken. Als deze temperatuur Als de sensoruitgang is abnormaal, deze foutcode zal verschijnen."
