		"sys": "Versnellingsbak",
		"zs": "De koppelomvormer werkt als een koppeling in een handgeschakelde versnellingsbak, waardoor het koppel van de motor tijdelijk kan worden losgekoppeld van de transmissie voor soepel schakelen. Maar het verschil is dat de koppelomvormer kan fungeren als een koppelomvormer. zoals terugschakelen. Storingsoorzaken zijn onder meer koppelomvormerkoppeling (TCC) solenoïdeklepcircuit of gezamenlijke storing, TCC-solenoïdeklep mechanische storing, elektronische regelmodule (PCM of ECM) storing, enz. "
