		"sys": "computer of hulpuitgangscircuit",
		"zs": "Het elektronische stuurbekrachtigingssysteem (EPS) regelt de stroom bypass-hydraulische olie aan beide zijden van de stuurbekrachtigingszuiger op basis van het signaal van de voertuigsnelheidssensor (VSS), waardoor de stuurkracht op het stuur verandert . Deze foutcode geeft aan dat de elektronische regeleenheid (ECU) een fout in het regelcircuit van de stuurbekrachtiging heeft gedetecteerd. Oorzaken zijn onder meer de drukschakelaar van de stuurbekrachtiging, het circuit, de connectoren of de elektronische regeleenheid (ECU)."
