		"sys": "computer of hulpuitgangscircuit",
		"zs": "De functie van de gloeibougie is om het gecomprimeerde gas in de verbrandingskamer van de dieselmotor te verwarmen via de verwarmingsspiraal, waardoor de dieselmotor gemakkelijk start wanneer deze koud is. De gloeibougie-regelmodule kan automatiseren het voorverwarmings- en cyclusproces van de gloeibougie. Als de elektronische besturingseenheid (ECU) heeft gedetecteerd dat de spanning van het circuit van de gloeibougie van cilinder 5 hoger is dan de gekalibreerde maximale waarde, verschijnt deze storingscode."
