		"sys": "Versnellingsbak",
		"zs": "De tussenbak is een accessoire op het voertuig met vierwielaandrijving. Zijn functie is om het vermogen van de motor te verdelen, en het vermogen kan alleen worden afgegeven aan de achteras of aan de voor-/achteras. tegelijkertijd. De storingsindicator (MIL), ook wel het motorcontrolelampje genoemd, wordt gebruikt om een geel of rood motorsymbool op het instrumentenpaneel te verlichten wanneer de regeleenheid een storing detecteert."
