		"des": "Lagedruk brandstofsysteemdruk - te hoog",
		"sys": "Brandstof-, lucht- of emissieregeling",
		"zs": "De rol van de lagedrukbrandstofpomp (40-95psi) is om benzine van de tank naar de hogedrukbrandstofpomp te sturen. De nokkenasaangedreven hogedrukbrandstofpomp kan de benzine onder druk brengen tot 1900psi. Het brandstofsysteem moet een constante druk behouden, als de oliedruk te laag is, zal de brandstofinjector te zwak of niet inspuiten, als de oliedruk te hoog is, zal het oliecircuit beschadigd raken of zal de injector beschadigd raken. Deze foutcode geeft aan dat de elektronische regeleenheid (ECU) detecteert dat de lagedrukbrandstofsysteemdruk gedurende een bepaalde tijd op het instelpunt hoger is dan de gekalibreerde maximale waarde Overdruk kan een probleem zijn met de brandstofdrukregelaar, verstopping in de oliecircuit, brandstofdruksensor, regeleenheid brandstofpomp, enz."
