		"des": "Inlaatluchttemperatuursensor 1 circuit laag (bank 2)",
		"sys": "Brandstof-, lucht- of emissieregeling",
		"zs": "De rol van de sensor voor de inlaatluchttemperatuur (IAT) is om de inlaatluchttemperatuur van de motor naar de elektronische regeleenheid (ECU) te sturen in de vorm van een spanningssignaal om een referentie te bieden voor brandstofinjectiecorrectie. Als de elektronische regeleenheid (ECU) detecteert dat de signaalspanning van de inlaatluchttemperatuursensor (IAT) lager is dan de minimumwaarde van de zelftest (0,2 volt of 121 graden Celsius), verschijnt deze foutcode."
