		"sys": "Brandstof of lucht",
		"zs": "De functie van de zuurstofsensor is om het zuurstofgehalte in het uitlaatgas van de motor te meten om de hoeveelheid brandstofinjectie te corrigeren, zodat de motor de beste lucht-brandstofverhouding kan verkrijgen. In de OBD-foutcode, u zult vaak het aantal rijen en nummers zien Zuurstofsensor Rij 1 verwijst naar de rij waar cilinder 1 zich bevindt, en de resterende rij is rij 2. Ongeacht welke rij, de eerste sensor verwijst altijd naar de stroomopwaartse zuurstofsensor (vóór de katalysatortank), verwijst de 2e sensor altijd naar de stroomafwaartse zuurstofsensor (na de katalysatortank). Deze foutcode verschijnt wanneer de spanning van het verwarmde zuurstofsensorsignaal gedurende een ingestelde tijd hoger blijft dan 1,5 volt. De oorzaak van de fout is het signaal van de zuurstofsensor. Het circuit is kortgesloten naar positief, de zuurstofsensor zelf is defect, de elektronische regelmodule (PCM of ECM) is defect, enz."
