		"sys": "Emissiecontrole",
		"zs": "De rol van het uitlaatgasrecirculatiesysteem (EGR) is om een kleine hoeveelheid uitlaatgas in het inlaatspruitstuk te leiden wanneer de motor onder hoge belasting draait. De aanwezigheid van deze uitlaatgassen verlaagt de temperatuur en druk van de verbrandingskamer, waardoor de uitstoot van stikstofoxide wordt verminderd. Voor voertuigen met elektronische uitlaatgasrecirculatie (EEGR), bewaakt de elektronische regeleenheid (ECU) continu de EEGR-spoelen, circuits. Als een toestand zoals een open circuit, een kortsluiting wordt gevonden, zal deze DTC verschijnen. Op dit moment zal het gehele Het EEGR-systeem worden uitgeschakeld en andere bewaking van EEGR zal worden beëindigd. Oorzaken van falen zijn EEGR-actuator, of zijn circuits, gezamenlijke storing, EEGR-hijsmotor, elektronische besturingsmodule, enz."
