		"sys": "computer of hulpuitgangscircuit",
		"zs": "Als de lengte van de doorlaat van het inlaatspruitstuk (runner) optimaal is, zal de drukgolf die wordt gegenereerd door het sluiten van de klep helpen om het olie-luchtmengsel in de motor te leiden. Het probleem is dat de optimale doorlaat van het inlaatspruitstuk voor verschillende motortoerentallen is ook anders.De functie van de spruitstukafstemklep (MTV) is om de inlaatlucht in de doorgangen van het inlaatspruitstuk van verschillende lengtes te leiden, afhankelijk van het motortoerental, om het koppel van de motor bij verschillende snelheden te optimaliseren Als de elektronische besturingseenheid (ECU) automatisch wordt geactiveerd, verschijnt deze foutcode wanneer tijdens de inspectie wordt gedetecteerd dat de spanning van het regelcircuit van de afstemklep van het inlaatspruitstuk lager is dan de gekalibreerde minimumwaarde."
