		"sys": "Voertuigsnelheid en stationair toerentalregeling",
		"zs": "De functie van het positieve carterventilatiesysteem (PCV) is om het doorblaasgas in het carter om te leiden (aan het einde van het verbrandingsproces van de motor lekt er een onverbrand mengsel uit de zuigerveren in het carter onder hoge druk). druk, de industrie verwijst naar deze lekkage als blow-by gas) Het vacuüm dat door de motor wordt gegenereerd, wordt in het inlaatspruitstuk gebracht en vervolgens zal het blow-by gas de cilinder binnengaan met frisse lucht en worden verbrand, waardoor vervuiling wordt verminderd en verbetering wordt bereikt motorefficiëntie. Als de elektronische regeleenheid (PCV) detecteert dat de spanning van het circuit van de positieve carterventilatieverwarming lager is dan de gekalibreerde minimumwaarde, verschijnt deze foutcode."
