		"sys": "Brandstof of lucht",
		"zs": "De functie van de zuurstofsensor is om het zuurstofgehalte in het uitlaatgas van de motor te meten om de hoeveelheid brandstofinjectie te corrigeren, zodat de motor de beste lucht-brandstofverhouding kan verkrijgen. In de OBD-foutcode, u zult vaak het aantal rijen en nummers zien Zuurstofsensor Rij 1 verwijst naar de rij waar cilinder 1 zich bevindt, en de resterende rij is rij 2. Ongeacht welke rij, de eerste sensor verwijst altijd naar de stroomopwaartse zuurstofsensor (vóór de katalytische tank), de tweede sensor is altijd de stroomafwaartse zuurstofsensor (na de katalytische tank). De monitor van de verwarmde zuurstofsensor volgt de snelheid van spanningsverandering tijdens het stijgen en dalen van het zuurstofsensorsignaal. Als de elektronische regeleenheid (ECU ) detecteert dat de lucht-brandstofverhouding verandert van rijk naar Tijdens het lean-proces blijft de veranderingssnelheid van de spanning achter en verschijnt deze foutcode."
