		"dm": "P041A",
		"des": "Uitlaatgasrecirculatietemperatuursensor B circuit",
		"sys": "Emissiecontrole",
		"zs": "De rol van het uitlaatgasrecirculatiesysteem (EGR) is om een kleine hoeveelheid uitlaatgas in het inlaatspruitstuk te leiden wanneer de motor onder hoge belasting draait. De aanwezigheid van deze uitlaatgassen verlaagt de temperatuur en druk van de verbrandingskamer, waardoor de vervuiling door stikstofoxide wordt verminderd. Deze storingscode verschijnt als de elektronische regeleenheid (ECU) detecteert dat de signaalspanning van de temperatuursensor van de uitlaatgasrecirculatieklep (EGR) buiten het gekalibreerde normale bereik ligt."
