		"dm": "P0303",
		"des": "Cilinder 3 ontstekingsfout gedetecteerd",
		"sys": "Ontstekingssysteem",
		"zs": "Cilindermisfire verwijst naar het fenomeen dat het mengsel om verschillende redenen tijdens de werking van de motor niet goed in de cilinder kan worden verbrand. Als de elektronische regeleenheid (ECU) een misfire detecteert, kan dit schade aan de katalysator veroorzaken omvormer, Het foutindicatielampje gaat knipperen en de motor moet onmiddellijk worden uitgeschakeld. Deze foutcode geeft aan dat de elektronische regeleenheid (ECU) een ontstekingsfout in cilinder 3 heeft gedetecteerd. Foutoorzaken zijn onder meer een ontstekingssysteemfout, brandstoftoevoerfout, luchtlekkage van inlaatspruitstuk of EGR, PCV, mechanische cilinderstoring, enz."
