		"dm": "P0535",
		"des": "A/C Verdamper Temperatuur Sensor Circuit",
		"sys": "Voertuigsnelheid en stationair toerentalregeling",
		"zs": "De functie van de temperatuursensor van de verdamper van de airconditioner is om de temperatuur in de verdamper van de airconditioner door te geven aan de bedieningsmodule van de airconditioner in de vorm van een elektrisch signaal, zodat wanneer de temperatuur in de verdamper van de airconditioner te laag, de compressor van de airconditioner is uitgeschakeld om te voorkomen dat de airconditioner bevriest. Deze foutcode geeft aan dat de spanning van het signaalcircuit van de verdampertemperatuur (ACET) van de airconditioner buiten het kalibratiebereik ligt. De oorzaken van de fout zijn onder meer het signaalcircuit van de luchttemperatuursensor van de verdamper van de airconditioner, de storing van de temperatuursensor van de verdamper van de airconditioner zelf, de storing van de elektronische regelmodule (PCM) of ECM), enz."
