		"zs": "Als de lengte van de doorlaat van het inlaatspruitstuk (runner) optimaal is, zal de drukgolf die wordt gegenereerd door het sluiten van de klep helpen om het olie-luchtmengsel in de motor te leiden. Het probleem is dat de optimale doorlaat van het inlaatspruitstuk voor verschillende motortoerentallen is ook anders.De rol van de afstemklep van het inlaatspruitstuk (IMTV) is om de inlaatlucht in de doorgangen van het inlaatspruitstuk van verschillende lengtes te brengen, afhankelijk van het motortoerental, om het koppel van de motor bij verschillende toerentallen te optimaliseren Als de elektronische regeleenheid (ECU) tijdens de zelftest wordt gedetecteerd dat de spanning van het regelcircuit van de afstemklep van het inlaatspruitstuk de normale waarde van de kalibratie overschrijdt, verschijnt de foutcode.De oorzaken van de fout omvatten IMTV-signaalcircuit open circuit of kortsluiting naar aarde, IMTV-actuatorassemblagefout, elektronische besturingsmodule (PCM of ECM) fout, enz. "
