		"zs": "De rol van de sensor voor de inlaatluchttemperatuur (IAT) is om de inlaatluchttemperatuur van de motor door te geven aan de elektronische regeleenheid (ECU) in de vorm van een spanningssignaal om een referentie te bieden voor brandstofinjectiecorrectie. De elektronische regeleenheid (ECU) Nadat de motor gedurende een bepaalde periode (meestal 6 uur) is uitgeschakeld, wordt de redelijkheid van de sensor voor de inlaatluchttemperatuur (IAT) bepaald door de meetwaarden van de inlaatluchttemperatuur (IAT) te vergelijken ) sensor en de motorkoelvloeistoftemperatuursensor (ECT) Als het verschil tussen de aflezing van de inlaatluchttemperatuursensor (IAT) en de aflezing van de motorkoelvloeistoftemperatuursensor (ECT) bij de eerste start de ingestelde kalibratiewaarde overschrijdt (meestal 17°C), verschijnt de foutcode."
