		"sys": "Brandstof-, lucht- of emissieregeling",
		"zs": "De turbocompressor gebruikt het traagheidsmomentum van het uitlaatgas dat uit de motor komt om de turbine aan te drijven, die op zijn beurt de coaxiale waaier aandrijft om de inlaatlucht onder druk te zetten, waardoor het vermogen van de auto toeneemt. De supercharger is een supercharger gebruikt om het vermogen van de verbrandingsmotor te vergroten. Luchtcompressor voor inlaatlucht. Meer inlaatlucht zorgt voor meer zuurstof naar de motor, waardoor de regeleenheid meer brandstof kan leveren, wat het vermogen verhoogt. De rol van de turbo/supercharger boost controller is wanneer Nadat de boostdruk de ingestelde waarde heeft bereikt, duwt de luchtdruk de wastegate-actuator (pneumatisch mechanisch) om een deel van het uitlaatgas van de turbo te omzeilen, waardoor de turbosnelheid wordt verlaagd en het boostniveau wordt geregeld. Deze foutcode geeft aan dat de boostregeling van de turbo/supercharger Een circuitspanning ligt buiten het normale bereik voor kalibratie."
