		"zs": "De functie van de injector is om de brandstof te vernevelen zodat deze voldoet aan de vereisten van verbranding. Het werkingsprincipe is dat wanneer de elektromagnetische spoel wordt bekrachtigd, er zuigkracht wordt gegenereerd, de naaldklep wordt opgezogen, het mondstukgat wordt geopend en de brandstof gaat door de kop van de naaldklep. De ringvormige opening tussen de asnaald en het mondstukgat wordt met hoge snelheid gespoten om een nevel te vormen. De elektronische besturingseenheid regelt de hoeveelheid brandstofinjectie door het openingstijdsinterval te regelen (ook wel de pulsbreedte genoemd) van de injector. Als de injector van de tweede cilinder deze storingscode verschijnt wanneer de spanning van het regelcircuit lager is dan de gekalibreerde minimumwaarde. Oorzaken zijn onder meer het regelcircuit van de injector, de connector of de injector zelf; de injectorregeling module (FICM)."
