		"sys": "Brandstof-, lucht- of emissieregeling",
		"zs": "De rol van de krukas is om de op en neergaande beweging van de zuiger om te zetten in een roterende beweging. De rol van de nokkenas is om het openen en sluiten van de kleppen te regelen. Het motorpositiesysteem gebruikt de signalen van de krukaspositiesensor en de nokkenaspositiesensor om een hoekteller te genereren De hoekteller wordt vervolgens gesynchroniseerd met de hoek van het krukaswiel om de huidige positie van de motor te geven.Als de elektronische regeleenheid (ECU) detecteert dat de twee nokkenassen in rij 1 gedurende een bepaalde tijd niet overeenkomen met de krukas, zal deze foutcode verschijnen. "
