		"des": "HO2S verwarmingscircuit (bank 2, sensor 3)",
		"sys": "Brandstof-, lucht- of emissieregeling",
		"zs": "De functie van de zuurstofsensor is om het zuurstofgehalte in het uitlaatgas van de motor te meten om de hoeveelheid brandstofinjectie te corrigeren, zodat de motor de beste lucht-brandstofverhouding kan verkrijgen. In de OBD-foutcode, u zult vaak het aantal rijen en nummers zien Zuurstofsensor Rij 1 verwijst naar de rij waar cilinder 1 zich bevindt, en de resterende rij is rij 2. Ongeacht welke rij, de eerste sensor verwijst altijd naar de stroomopwaartse zuurstofsensor (vóór de katalytische tank), verwijst de 2e sensor altijd naar de stroomafwaartse zuurstofsensor (na de katalytische tank). De elektronische regeleenheid (ECU) handhaaft de temperatuur van de zuurstofsensor op 780oC door de aan/uit van de zuurstofsensorverwarming te regelen. Als de zuurstofsensor werkt niet binnen de ingestelde tijd. Wanneer de gewenste temperatuur is bereikt, of de ECU de ingestelde temperatuur niet kan handhaven, verschijnt deze foutcode."
