		"sys": "Brandstof of lucht",
		"zs": "De turbocompressor gebruikt het traagheidsmomentum van het uitlaatgas dat uit de motor komt om de turbine aan te drijven, die op zijn beurt de coaxiale waaier aandrijft om de inlaatlucht onder druk te zetten, waardoor het vermogen van de auto toeneemt. De supercharger is een supercharger gebruikt om het vermogen van de verbrandingsmotor te vergroten. Luchtcompressor voor inlaatlucht. Meer inlaatlucht zorgt voor meer zuurstof naar de motor, waardoor de regeleenheid meer brandstof kan leveren, wat het vermogen verhoogt. Boost-sensor, ook wel boost-druksensor genoemd (BPS), Zijn functie is om de boostdruk als een elektrisch signaal naar de elektronische regeleenheid (ECU) over te brengen. Als de signaalspanning van de boostsensor hoger is dan 5,0 volt, verschijnt deze foutcode."
