		"sys": "Voertuigsnelheid en stationair toerentalregeling",
		"zs": "Het cruise control-systeem (CRUISE CONTROL SYSTEM) stelt de bestuurder in staat om de voertuigsnelheid automatisch aan te houden zonder het gaspedaal in te trappen. De oorzaak van de storing is de multifunctionele ingangsschakelaar van de cruise control, het circuit, de connector, enz. ."
