		"des": "Brandstofdrukregelaar 1 Stuurcircuit hoog",
		"sys": "Brandstof-, lucht- of emissieregeling",
		"zs": "De brandstofdrukregelaar gebruikt een door een veer aangedreven klep om overtollige benzine terug naar de tank te laten stromen, waardoor een constante druk in het brandstofcircuit wordt gehandhaafd. De brandstofdrukregelaar heeft een vacuümleiding die is aangesloten op de inlaat. Zorg voor overeenkomstige benzinedruk onder verschillende motorbedrijfsomstandigheden (beoordelen van motorbelasting op basis van de mate van vacuüm).De meeste auto's brandstofdrukregelaars bevinden zich op de brandstofaftakkingsleiding, maar sommige auto's brandstofdrukregelaars bevinden zich in de brandstoftank.Deze storingscode verschijnt als de Electronic Control Unit (ECU) detecteert dat de spanning van het stuurcircuit van de brandstofdrukregelaar 1 hoger is dan de gekalibreerde maximale waarde."
