		"zs": "De rol van de sensor voor de inlaatluchttemperatuur (IAT) is om de inlaatluchttemperatuur van de motor naar de elektronische regeleenheid (ECU) te sturen in de vorm van een spanningssignaal om een referentie te bieden voor brandstofinjectiecorrectie. Als de elektronische regeleenheid (ECU) detecteert dat de signaalspanning van de inlaatluchttemperatuur (IAT)-sensor hoger is dan de maximale waarde van de zelftest (4,6 volt of -50 graden Celsius), verschijnt deze foutcode."
