		"des": "Temperatuursensorcircuit inlaatluchtkoeler Onderbroken/Onregelmatig (Bank 2)",
		"sys": "Brandstof-, lucht- of emissieregeling",
		"zs": "De turbocompressor gebruikt het traagheidsmomentum van het uitlaatgas dat uit de motor komt om de turbine aan te drijven, die op zijn beurt de coaxiale waaier aandrijft om de inlaatlucht onder druk te zetten, waardoor het vermogen van de auto toeneemt. De inlaatluchtkoeler ( ook wel de intercooler genoemd) ) wordt gebruikt om de aangejaagde lucht uit de aanjager te koelen. Nadat de lucht door de aanjager is gegaan, neemt de druk toe en stijgt de temperatuur. De temperatuur van de aangejaagde lucht kan worden verlaagd door de luchtkoeler van de aanjager, waardoor de lucht dichtheid en verhoging van de laadefficiëntie om het motorvermogen te vergroten en de uitstoot te verminderen. Oorzaken van deze foutcode zijn onder meer de temperatuursensor van de inlaatluchtkoeler, het circuit of gewrichtsproblemen."
