		"des": "Efficiëntie katalysatorsysteem onder drempel (bank 1)",
		"sys": "Emissiecontrole",
		"zs": "Een katalysator (ook wel katalysator genoemd) is een apparaat voor het zuiveren van uitlaatgassen dat de werking van een katalysator gebruikt om CO, HC en NOx in de uitlaat om te zetten in gassen die onschadelijk zijn voor het menselijk lichaam. bevindt zich voor de uitlaatdemper van de uitlaatpijp.De elektronische regeleenheid (ECU) detecteert dat de wisselkoers van 1/2 van de zuurstofsensor gelijk is aan de wisselkoers van 1/1, dus wordt geconcludeerd dat de efficiëntie van de Het katalysatorsysteem is te laag. De oorzaak van de storing is onder meer de uitlaatpijp of uitlaatgaslekkage nabij het uitlaatspruitstuk, defecte katalysatortank, defecte motorkoelvloeistoftemperatuursensor (ECT), motorstoring of timingvertraging, vuile olie, defecte zuurstofsensor , brandstofsysteemdruk te hoog enz."
