		"dm": "P010A",
		"des": "Massa of Volume Luchtstroom B Circuit",
		"sys": "Brandstof of lucht",
		"zs": "De functie van de luchtstroomsensor (MAF) is om de luchtstroom om te zetten in een elektrisch signaal en dit naar de elektronische regeleenheid (ECU) te sturen als een van de basissignalen om de hoeveelheid brandstofinjectie te bepalen. Als de ECU detecteert de luchtstroom (MAF) sensor. De signaalspanning valt buiten het normale kalibratiebereik, deze foutcode verschijnt."
