		"sys": "Emissiecontrole",
		"zs": "Het verdampingsemissiesysteem (EVAP) leidt benzinedampen van de brandstoftank naar een opslagtank met actieve kool die benzinedampen absorbeert. De motor gebruikt vervolgens frisse lucht om deze benzinedampen in de verbrandingskamer van de motor te spoelen. controle-eenheid (ECU) controleert continu het verdampingsemissiecontrolesysteem om ervoor te zorgen dat er geen brandstofdamplekken zijn. Deze foutcode verschijnt als de ECU een klein (groter dan 1,016 mm diameter) brandstofdamplek detecteert."
