		"zs": "De rol van de nokkenas is het regelen van het openen en sluiten van de klep. In het variabele kleptimingsysteem verandert de elektronische nokkenasregelklep (of olieregelklep, OCV) de De hoek van de nokkenas wordt aangepast door middel van oliedruk naar de nokkenasversteller (mechanisch) om ervoor te zorgen dat de kleppen op het optimale moment openen en sluiten. Dit optimaliseert de efficiëntie en het vermogen van de motor in alle toerenbereiken. Als de elektronische regeleenheid (ECU) detecteert dat de De spanning van een (inlaat/links/voor) nokkenasprofielbesturingscircuit heeft gedurende een bepaalde tijd het gekalibreerde normale bereik overschreden, waarna deze foutcode verschijnt."
