		"zs": "De functie van de koppelingspositiesensor is om de informatie of de koppeling is ingedrukt of niet naar de elektronische regeleenheid te sturen in de vorm van een elektrisch signaal, dat wordt gebruikt als een belangrijke parameter om het starten van de motor te regelen en cruise control-systeem."
