		"zs": "De batterijcontrolemodule regelt de batterijventilator aan/uit op basis van het signaal van de batterijtemperatuursensor. Deze foutcode verschijnt als de batterijcontrolemodule detecteert dat de signaalcircuitspanning van de batterijtemperatuursensor hoger is dan de gekalibreerde maximale waarde."
