		"zs": "De rol van de sensor voor de inlaatluchttemperatuur (IAT) is om de inlaatluchttemperatuur van de motor door te geven aan de elektronische regeleenheid (ECU) in de vorm van een spanningssignaal om een referentie te bieden voor brandstofinjectiecorrectie. De elektronische regeleenheid (ECU) Nadat de motor gedurende een bepaalde periode (meestal 6 uur) is uitgeschakeld, wordt de redelijkheid van de sensor voor de inlaatluchttemperatuur (IAT) bepaald door de meetwaarden van de inlaatluchttemperatuur (IAT) te vergelijken ) sensor en de koelvloeistoftemperatuursensor (ECT) Wanneer het verschil tussen de aflezing van de inlaatluchttemperatuursensor (IAT) en de aflezing van de motorkoelvloeistoftemperatuursensor (ECT) de ingestelde kalibratiewaarde overschrijdt (meestal 17°C) bij de eerste start verschijnt de foutcode. De oorzaak van de fout is onder meer het IAT-sensorcircuit, de connector of de storing zelf; de storing van de elektronische regelmodule (PCM of ECM), enz. "
