		"zs": "Het Motor Electronic System Cooling System (MECS) is een onafhankelijk systeem dat zorgt voor koeling van de versnellingsbak (bijv. eCVT) motor, besturingsmodule en DC/DC-omvormer. Het heeft zijn eigen radiateur, koelvloeistofpomp, koelvloeistoftemperatuursensor , enz. De koelvloeistoftemperatuursensor (MECT) van het motorelektronische systeem gebruikt het principe van een thermistor om de temperatuur van de koelvloeistof van het motorelektronische systeem elektronisch over te brengen naar de elektronische regeleenheid (ECU).Als de regeleenheid detecteert dat de koelvloeistoftemperatuur van het motorelektronische (MECT) sensorsignaalfout, deze storingscode verschijnt."
