		"des": "MAP - Inlaatdrukcorrelatie turbocompressor/supercharger",
		"sys": "Brandstof-, lucht- of emissieregeling",
		"zs": "De Manifold Absolute Pressure (MAP)-sensor meet de druk (vacuüm) in het inlaatspruitstuk. De Powertrain Control Module (PCM) past vervolgens het verschil aan tussen de druk in het inlaatspruitstuk en de atmosferische druk. Het verschil (lineaire relatie met motorbelasting ) wordt gebruikt als basis voor het bepalen van de basisinjectiehoeveelheid van de injector om de motor te helpen de beste lucht-brandstofverhouding te bereiken onder verschillende belastingen. Als de elektronische regeleenheid (ECU) constateert dat de absolute druk in het spruitstuk (MAP ) het signaal verschil tussen de sensor en de inlaatdruksensor van de turbo/supercharger (stroomafwaarts van de gasklep) overschrijdt de kalibratiewaarde (meestal 10,35 KPa) binnen een ingestelde tijdsperiode (2,5 seconden), en deze foutcode verschijnt."
