	"P024E": {
		"zzs": "Alle autofabrikanten",
		"dm": "P024E",
		"des": "Inlaatluchtkoeler bypass positiesensor A circuit laag",
		"sys": "Brandstof of lucht",
		"zs": "De turbocompressor gebruikt het traagheidsmomentum van het uitlaatgas dat uit de motor komt om de turbine aan te drijven, die op zijn beurt de coaxiale waaier aandrijft om de inlaatlucht onder druk te zetten, waardoor het vermogen van de auto toeneemt. De inlaatluchtkoeler ( ook wel de intercooler genoemd) ) wordt gebruikt om de aangejaagde lucht uit de aanjager te koelen. Nadat de lucht door de aanjager is gegaan, neemt de druk toe en stijgt de temperatuur. De temperatuur van de aangejaagde lucht kan worden verlaagd door de luchtkoeler van de aanjager, waardoor de lucht dichtheid en verhoging van de laadefficiëntie om het motorvermogen te verbeteren en emissies te verminderen.De functie van de bypassklep van de inlaatluchtkoeler is om een deel van de lucht uit de luchtkoeler te omzeilen.Deze lucht wordt vervolgens gemengd met de lucht die wordt gekoeld door de luchtkoeler en ga dan naar de motor om ervoor te zorgen dat de temperatuur van de inlaatlucht hoger is dan de dauwtemperatuur. Als de circuitspanning van de bypassklep van de luchtkoeler lager is dan de gekalibreerde minimumwaarde, verschijnt deze foutcode."
	},
