		"sys": "computer of hulpuitgangscircuit",
		"zs": "De motorregeleenheid, ook wel motorregeleenheid genoemd (sommige ingebouwde motorregelmodules en transmissieregelmodules zijn geïntegreerd in een regelmodule voor de aandrijflijn), bestuurt de werking van de gehele motor. De belangrijkste functie is om de De optimale hoeveelheid brandstofinjectie en ontstekingstijdstip van de motor te regelen.Een andere belangrijke rol is het bewaken van de componenten van uitlaatemissiecontrole.De rol van de voertuigsnelheidssensor (VSS) is om de snelheid van de auto naar de elektronische besturing over te brengen eenheid (ECU) in de vorm van een elektrisch signaal, als referentiebasis voor het regelen van het stationaire toerental van de motor, automatisch schakelen van de transmissie, vergrendeling van de koppelomvormer, het openen en sluiten van de koelventilator van de motor, en cruise control en andere functies."
