		"zs": "De functie van de gloeibougie is om het gecomprimeerde gas in de verbrandingskamer van de dieselmotor te verwarmen via de verwarmingsspiraal, waardoor de dieselmotor gemakkelijk start wanneer deze koud is. De gloeibougie-regelmodule kan automatiseren het voorverwarmings- en cyclusproces van de gloeibougie. Als de elektronische regeling Deze storingscode verschijnt wanneer de eenheid (ECU) de communicatie met de gloeibougieregelmodule (GPCM) heeft verloren of een foutmelding van de GPCM heeft ontvangen over een defecte CAN-busverbinding."
