		"des": "Verdampingsemissiesysteem Onjuiste spoelstroom",
		"sys": "Emissiecontrole",
		"zs": "Het verdampingsemissiesysteem (EVAP) leidt benzinedampen van de brandstoftank naar een opslagtank met actieve kool die benzinedampen absorbeert. De motor gebruikt vervolgens frisse lucht om deze benzinedampen in de verbrandingskamer van de motor te spoelen. storing in de ontluchtingsstroom van het emissiesysteem, deze storingscode verschijnt Storingsoorzaken zijn onder meer lekkage van het uitlaatspruitstuk of de uitlaatpijp, storing van de katalysator zelf, motorkoelvloeistoftemperatuur (ECT) of cilinderkoptemperatuursensor (CHT) Storing, motorstoring of ontstekingstijdstip te laat , olie te vuil, zuurstofsensor voor of achter defect, brandstofsysteemdruk te hoog, etc."
