		"des": "RPM van stationair luchtregelsysteem hoger dan verwacht",
		"sys": "Voertuigsnelheid en stationair toerentalregeling",
		"zs": "De Idle Air Control (IAC)-klep heeft een beweegbare naaldklep die wordt bestuurd door een nauwkeurig bewegende stappenmotor. Met de gasklep gesloten regelt de IAC-klep het stationaire toerental door de luchtstroom in de bypassleiding te veranderen. gecontroleerd om zich aan te passen aan het stationaire toerental onder verschillende omstandigheden.Als de elektronische regeleenheid (ECU) detecteert dat het stationaire toerental van de motor hoger is dan de ingestelde waarde, verschijnt deze foutcode.De oorzaken van de fout zijn onder meer luchtlekkage na het gasklephuis , storing IAC-regelcircuit, storing IAC-solenoïdeklep, storing regelmodule gasklep, storing elektronische regelmodule (PCM of ECM), storing voertuigsnelheidssensor, etc."
