		"des": "Opschakelen/Overslaan Solenoid Regelcircuit",
		"sys": "Versnellingsbak",
		"zs": "Voor sommige krachtige auto's, om de brandstofefficiëntie van de auto te verbeteren en de uitstoot te verminderen, wordt, wanneer aan de voorwaarden wordt voldaan (lage snelheid, klein gaspedaal, de auto is opgewarmd, enz.), de overslaan van de solenoïdeklep voorkomt dat de versnelling in de 2e, 3e versnelling schakelt, wat overeenkomt met het forceren van de schakelhendel direct van de 1e naar de 4e versnelling. Deze storingscode geeft een fout aan in het regelcircuit van de overslaande solenoïdeklep."
