		"sys": "Voertuigsnelheid en stationair toerentalregeling",
		"zs": "De functie van de thermostaat is om te sluiten wanneer de koelvloeistoftemperatuur laag is, alleen de koelvloeistof in de motor te laten circuleren en de snelheid van de warme auto te verhogen; wanneer de watertemperatuur de ingestelde temperatuur overschrijdt, schakelt de thermostaat gaat open om koeling mogelijk te maken De vloeistof circuleert naar de radiator van de watertank, wat de koelefficiëntie effectief kan verbeteren. Deze foutcode geeft aan dat de elektronische regeleenheid (ECU) detecteert dat de spanning van het regelcircuit van de thermostaatverwarming lager is dan de minimumwaarde van de kalibratie. De oorzaak van de storing is de thermostaatverwarming, het circuit, de connector of het relais."
