		"des": "Turbocharger/Supercharger Wastegate Solenoid A Hoog",
		"sys": "Brandstof of lucht",
		"zs": "De turbocompressor gebruikt het traagheidsmomentum van het uitlaatgas dat uit de motor komt om de turbine aan te drijven, die op zijn beurt de coaxiale waaier aandrijft om de inlaatlucht onder druk te zetten, waardoor het vermogen van de auto toeneemt. De supercharger is een supercharger gebruikt om het vermogen van de verbrandingsmotor te vergroten. Luchtcompressor voor inlaatlucht. Meer inlaatlucht zorgt voor meer zuurstof naar de motor, waardoor de regeleenheid meer brandstof kan leveren, wat het vermogen verhoogt. De wastegate-magneetklep werkt door het regelen van de uitlaatgasstroom naar de turbine (waarbij de rest van de uitlaat wordt omzeild) om de turbosnelheid en dus de maximale boostdruk aan te passen. Deze storingscode verschijnt als de elektronische regeleenheid (ECU) detecteert dat de circuitspanning van de wastegate-solenoïde A hoger is dan de gekalibreerde maximale waarde."
