		"zs": "Het doel van de transmissievloeistofpomp is om werkdruk te leveren aan de transmissievloeistof wanneer de motor draait. De schakelsolenoïdeklep regelt de hydraulische druk naar de transmissiekoppeling door de transmissievloeistofregelklep te openen of te sluiten om te regelen Het doel van de hulptransmissievloeistofpomp is om de transmissievloeistof onder druk te zetten wanneer de motor niet draait (zoals bij het trekken van een aanhangwagen) om te voorkomen dat de transmissie oververhit raakt."
