		"des": "Barometrische druk te laag",
		"sys": "Brandstof of lucht",
		"zs": "De rol van de luchtdruksensor (soms de High Altitude Compensator, HAC genoemd) is om de luchtdruk als een elektrisch signaal naar de elektronische regelmodule te sturen. De luchtdruk varieert met het weer en de hoogte. Hoe lager de druk , hoe armer de lucht. De Powertrain Control Module (PCM) past de brandstoftoevoer aan op basis van de luchtdrukwaarde om de motor te helpen de optimale lucht-brandstofverhouding te bereiken. De luchtdruksensor detecteert dat de luchtdruk te laag is. De oorzaken van de storing zijn onder meer de luchtdruksensor, het circuit, de connector of de elektronische regeleenheid (ECU)."
