		"sys": "Emissiecontrole",
		"zs": "De regelklep voor de uitlaatdruk is een regelklep met variabele stand. Zijn belangrijkste functie is om de motor snel op te warmen door de uitlaatdruk te veranderen (verhoogde motorbelasting) wanneer de buitentemperatuur extreem laag is (<5 graden Celsius) Deze storingscode verschijnt als de elektronische regeleenheid (ECU) detecteert dat de circuitspanning van de uitlaatdrukregelklep A de gekalibreerde normale waarde overschrijdt."
