		"dm": "P0867",
		"des": "Transmissie Vloeistofdruk",
		"sys": "Versnellingsbak",
		"zs": "De schakelsolenoïdeklep regelt de hydraulische druk naar de transmissiekoppeling door de transmissievloeistofregelklep te openen of te sluiten om de ontkoppeling en inschakeling voor schakelen te regelen. Nauwkeurige regeling van de transmissievloeistofdruk is belangrijk voor soepel schakelen. De transmissievloeistofdruk (TFP) -sensor stuurt de transmissievloeistofdruk in de vorm van een elektrisch signaal naar de transmissieregelmodule (TCU), en de transmissievloeistofdrukregelsolenoïdeklep is verantwoordelijk voor het regelen van de transmissievloeistofdruk."
