		"sys": "Brandstof-, lucht- of emissieregeling",
		"zs": "De rol van de nokkenas is het regelen van het openen en sluiten van de klep. In het variabele kleptimingsysteem verandert de elektronische nokkenasregelklep (of olieregelklep, OCV) de oliedruk naar de nokkenasregelaar (mechanisch) wordt gebruikt om de hoek van de nokkenas aan te passen om ervoor te zorgen dat de klep op het optimale moment opent en sluit. De oorzaken van het falen van P0014 zijn onder meer de timing van de inlaat/linker/voorste nokkenas B is niet ingesteld. Het is vast, de nokkenas is mechanisch zit vast, of de actuatorklep zit vast in de open stand."
