	"P0239": {
		"zzs": "Alle autofabrikanten",
		"dm": "P0239",
		"des": "Turbocharger/Supercharger Boost Sensor B Circuit",
		"sys": "Brandstof of lucht",
		"zs": "De turbocompressor gebruikt het traagheidsmomentum van het uitlaatgas dat uit de motor komt om de turbine aan te drijven, die op zijn beurt de coaxiale waaier aandrijft om de inlaatlucht onder druk te zetten, waardoor het vermogen van de auto toeneemt. De supercharger is een supercharger gebruikt om het vermogen van de verbrandingsmotor te vergroten. Luchtcompressor voor inlaatlucht. Meer inlaatlucht zorgt voor meer zuurstof naar de motor, waardoor de regeleenheid meer brandstof kan leveren, wat het vermogen verhoogt. Boost-sensor, ook wel boost-druksensor genoemd (BPS), Zijn functie is om de boostdruk in de vorm van een elektrisch signaal naar de elektronische regeleenheid (ECU) over te brengen. Als de ECU detecteert dat het signaal van de boostsensor (BPS) buiten het gekalibreerde normale bereik valt, wordt deze foutcode zal verschijnen."
	},
	"P0068": {
		"zzs": "Alle autofabrikanten",
		"dm": "P0068",
		"des": "MAP/MAF - Correlatie gaskleppositie",
		"sys": "Brandstof-, lucht- of emissieregeling",
		"zs": "De Manifold Absolute Pressure (MAP)-sensor meet de druk (vacuüm) in het inlaatspruitstuk. De Powertrain Control Module (PCM) past vervolgens het verschil aan tussen de druk in het inlaatspruitstuk en de atmosferische druk. Het verschil (lineaire relatie met motorbelasting ) wordt gebruikt als basis voor het bepalen van de basisbrandstofinjectiehoeveelheid van de injector om de motor te helpen de beste lucht-brandstofverhouding te bereiken onder verschillende belastingen. De rol van de luchtstroomsensor (MAF) is om de luchtstroom om te zetten in de elektrische signaal wordt naar de elektronische regeleenheid (ECU) gestuurd als een van de basissignalen om de hoeveelheid brandstofinjectie te bepalen. De functie van de gaskleppositiesensor (TP) is om de openingsgraad van de gasklep naar de elektronische regeleenheid (ECU) te sturen ) in de vorm van een elektrisch signaal , als een van de basisparameters voor het regelen van de brandstofinjectie van de motor. Als de ECU constateert dat de belasting berekend door de spruitstuk absolute druk (MAP) sensor/luchtstroom (MAF) sensor en de gasklepstand ( TP) sensor is te verschillend, de foutcode zal Verschijnen zijn."
	},
