		"des": "Injector Circuit/Open - Cilinder 6",
		"sys": "Brandstof of lucht",
		"zs": "De functie van de injector is om de brandstof te vernevelen zodat deze voldoet aan de vereisten van verbranding. Het werkingsprincipe is dat wanneer de elektromagnetische spoel wordt bekrachtigd, er zuigkracht wordt gegenereerd, de naaldklep wordt opgezogen, het mondstukgat wordt geopend en de brandstof gaat door de kop van de naaldklep.De ringvormige opening tussen de schachtnaald en het mondstukgat van het onderdeel wordt met hoge snelheid gespoten om een nevel te vormen.De elektronische besturingseenheid regelt de hoeveelheid brandstofinjectie door de openingstijdinterval (ook wel de pulsbreedte) van de injector.Als de elektronische regeleenheid (ECU) Wanneer een fout wordt gedetecteerd in het injectorbesturingscircuit, verschijnt deze foutcode.De redenen voor de fout zijn onder meer injectorinterface, circuitfout , injector zelf fout, elektronische regelmodule (PCM of ECM) fout, etc."
