		"sys": "Voertuigsnelheid en stationair toerentalregeling",
		"zs": "Het cruise control-systeem (CRUISE CONTROL SYSTEM) stelt de bestuurder in staat om automatisch de snelheid van het voertuig aan te houden zonder het gaspedaal in te trappen. De elektronische regeleenheid (ECU) detecteert dat de spanning van de multifunctionele ingangsschakelaar van de cruise control Een circuit is hoger dan de gekalibreerde maximale waarde. Storingsoorzaken zijn onder meer multifunctionele schakelaars, circuits, connectoren, mechanische storingen, etc."
