		"dm": "P048B",
		"des": "Uitlaatdrukregelklep positiesensor/schakelcircuit",
		"sys": "Emissiecontrole",
		"zs": "De regelklep voor de uitlaatdruk is een regelklep met variabele stand. Zijn belangrijkste functie is om de motor snel op te warmen door de uitlaatdruk te veranderen (verhoogde motorbelasting) wanneer de buitentemperatuur extreem laag is (<5 graden Celsius) Als de elektronische regeleenheid (ECU) detecteert dat de signaalspanning van de positiesensor van de uitlaatdrukregelklep de gekalibreerde normale waarde overschrijdt, verschijnt deze foutcode."
