		"dm": "P00B8",
		"des": "MAP - Massa- of volume-luchtstroomcorrelatie (bank 2)",
		"sys": "Brandstof-, lucht- of emissieregeling",
		"zs": "De Manifold Absolute Pressure (MAP)-sensor meet de druk (vacuüm) in het inlaatspruitstuk. De Powertrain Control Module (PCM) past vervolgens het verschil aan tussen de druk in het inlaatspruitstuk en de atmosferische druk. Het verschil (lineaire relatie met motorbelasting ) wordt gebruikt als basis voor het bepalen van de basisbrandstofinjectiehoeveelheid van de injector om de motor te helpen de beste lucht-brandstofverhouding te bereiken onder verschillende belastingen. De rol van de luchtstroomsensor (MAF) is om de luchtstroom om te zetten in de elektrische signaal wordt naar de elektronische regeleenheid (ECU) gestuurd als een van de basissignalen om de hoeveelheid brandstofinjectie te bepalen. Als de ECU constateert dat de belasting berekend door de spruitstuk absolute druk (MAP) -sensor en de luchtstroom (MAF) -sensor is te verschillend, de fout De code zal verschijnen."
