		"des": "Gloeibougiedetectie circuit laag",
		"sys": "Ontstekingssysteem",
		"zs": "De functie van de gloeibougie is om het gecomprimeerde gas in de verbrandingskamer van de dieselmotor te verwarmen via de verwarmingsspiraal, waardoor de dieselmotor gemakkelijk start wanneer deze koud is. De gloeibougie-regelmodule kan automatiseren het voorverwarmings- en cyclusproces van de gloeibougie. Als de elektronische besturing De eenheid (ECU) detecteert dat de spanning van het racebewakingscircuit van de elektrische verwarming lager is dan de gekalibreerde minimumwaarde, zal deze foutcode verschijnen."
