		"sys": "Hybride systeem",
		"zs": "Het Motor Electronic System Cooling System (MECS) is een onafhankelijk systeem dat zorgt voor koeling van de versnellingsbak (bijv. eCVT) motor, besturingsmodule en DC/DC-omvormer. Het heeft zijn eigen radiateur, koelvloeistofpomp, koelvloeistoftemperatuursensor , enz. De koelvloeistofpomp van het elektronische koelsysteem van de motor is een elektrische pomp van 12 volt die wordt bestuurd door een elektronische regeleenheid (ECU)."
