		"sys": "Ontstekingssysteem",
		"zs": "De rol van de nokkenas is het regelen van het openen en sluiten van de klep. In het variabele kleptimingsysteem verandert de elektronische nokkenasregelklep (of olieregelklep, OCV) de De hoek van de nokkenas wordt aangepast door middel van oliedruk naar de nokkenasversteller (mechanisch) om ervoor te zorgen dat de klep op het optimale moment opent en sluit.De rol van de nokkenaspositie (CMP) sensor is het aanpassen van de nokkenaspositie (de relatieve positie) wordt doorgegeven aan de elektronische regeleenheid (ECU) in de vorm van een spanningssignaal. Wanneer de elektronische regeleenheid (ECU) vaststelt dat hij de nokkenaspositie A (inlaat/links/voor) niet binnen een bepaalde tijd detecteert. Deze storingscode verschijnt wanneer het sensorsignaal wordt gedetecteerd. Oorzaken van storing zijn onder meer het circuit van de nokkenaspositie (CMP), de connector, het falen van zichzelf of het falen van de elektronische regelmodule (PCM of ECM)."
