		"des": "Aandrijfmotor A Fase U Stroom",
		"sys": "Hybride systeem",
		"zs": "De Hybrid Vehicle Electronic Control Unit (HV ECU) is verantwoordelijk voor het bewaken van de stroomsensor van de aandrijfmotoromvormer. Deze storingscode verschijnt als de HV ECU een fout detecteert."
