		"sys": "Voertuigsnelheid en stationair toerentalregeling",
		"zs": "De functie van de uitlaatgastemperatuursensor is om de uitlaatgastemperatuur in de vorm van een elektrisch signaal naar de elektronische regeleenheid (ECU) te sturen. De uitlaatgastemperatuur die wordt gegenereerd door de juiste lucht-brandstofverhouding is hoger dan de uitlaatgastemperatuur die wordt gegenereerd door de te rijke of te arme lucht-brandstofverhouding. De temperatuur van het uitlaatgas moet laag zijn. Een te hoge uitlaatgastemperatuur (>160 graden Celsius) veroorzaakt schade aan de motor. Als de elektronische regeleenheid (ECU) detecteert dat de signaalspanning van de uitlaatgastemperatuursensor binnen de ingestelde tijdsperiode (15 seconden) volt (misschien 0,2 volt) lager is dan 0,1 volt, verschijnt de storingscode."
