		"zs": "De rol van de nokkenas is het regelen van het openen en sluiten van de klep. In het variabele kleptimingsysteem verandert de elektronische nokkenasregelklep (of olieregelklep, OCV) de De hoek van de nokkenas wordt aangepast door middel van oliedruk naar de nokkenasversteller (mechanisch) om ervoor te zorgen dat de klep op het optimale moment opent en sluit.De rol van de nokkenaspositie (CMP) sensor is het aanpassen van de nokkenaspositie (de relatieve positie) wordt doorgegeven aan de elektronische regeleenheid (ECU) in de vorm van een spanningssignaal.Deze foutcode geeft aan dat de signaalspanning van de elektrische B (uitlaat/rechts/achter) nokkenaspositiesensor (CMP) onder de gekalibreerde minimumwaarde ligt.De oorzaak van de fout omvat cam Aspositie (CMP) sensorcircuit, gewricht, falen van zichzelf of falen van de elektronische regelmodule (PCM of ECM), enz."
