		"dm": "P0279",
		"des": "Cilinder 7 injectorcircuit laag",
		"sys": "Brandstof of lucht",
		"zs": "De functie van de injector is om de brandstof te vernevelen zodat deze voldoet aan de vereisten van verbranding. Het werkingsprincipe is dat wanneer de elektromagnetische spoel wordt bekrachtigd, er zuigkracht wordt gegenereerd, de naaldklep wordt opgezogen, het mondstukgat wordt geopend en de brandstof gaat door de kop van de naaldklep.De ringvormige opening tussen de schachtnaald en het mondstukgat van het onderdeel wordt met hoge snelheid gespoten om een nevel te vormen.De elektronische besturingseenheid regelt de hoeveelheid brandstofinjectie door de openingstijdinterval (ook wel de pulsbreedte genoemd) van de injector.Als de 7e cilinder injector Deze DTC zal verschijnen wanneer de spanning van het stuurcircuit lager is dan de gekalibreerde minimumwaarde.Oorzaken zijn onder meer het injectorstuurcircuit, de connector of de injector zelf; de injectorcontrolemodule (FICM)."
