		"zs": "De motorkoelvloeistoftemperatuursensor (ECT) zendt de temperatuur van de motorkoelvloeistof naar de elektronische regeleenheid (ECU) in de vorm van een elektrisch signaal via het principe van de thermistor, als basis voor het corrigeren van brandstofinjectie en Als P0116 verschijnt, betekent dit dat de aflezing van de koelvloeistoftemperatuursensor hoger is dan de gekalibreerde maximumwaarde (meestal 107 graden Celsius) wanneer de motor wordt gestart, of hoger is dan de aflezing van de inlaatluchttemperatuursensor (IAT) door een bepaalde waarde (meestal 17 graden Celsius). Oorzaken van uitval zijn o.a. Het koelvloeistofpeil is te laag, de sensor is niet goed gekalibreerd, of de sensor is defect etc."
