		"sys": "Brandstof-, lucht- of emissieregeling",
		"zs": "De rol van de luchtdruksensor (soms de High Altitude Compensator, HAC genoemd) is om de luchtdruk als een elektrisch signaal naar de elektronische regelmodule te sturen. De luchtdruk varieert met het weer en de hoogte. Hoe lager de druk , hoe armer de lucht. De aandrijflijncontrolemodule (PCM) corrigeert de brandstoftoevoer op basis van de luchtdrukwaarde om de motor te helpen de beste lucht-brandstofverhouding te bereiken. Deze foutcode geeft aan dat de luchtdruksensor is aangesloten op de turbo /supercharger-inlaat Het signaalverschil van de druksensor (stroomafwaarts van de gasklep) overschrijdt de gekalibreerde waarde (meestal 10,35 kPa) gedurende de ingestelde tijdsperiode (2,5 seconden)."
