		"zs": "De functie van de zuurstofsensor is om het zuurstofgehalte in het uitlaatgas van de motor te meten om de hoeveelheid brandstofinjectie te corrigeren, zodat de motor de beste lucht-brandstofverhouding kan verkrijgen. In de OBD-foutcode, u zult vaak het aantal rijen en nummers zien Zuurstofsensor Rij 1 verwijst naar de rij waar cilinder 1 zich bevindt, en de resterende rij is rij 2. Ongeacht welke rij, de eerste sensor verwijst altijd naar de stroomopwaartse zuurstofsensor (vóór de katalytische tank), de tweede sensor verwijst altijd naar de stroomafwaartse zuurstofsensor (na de katalytische tank). De verwarmde zuurstofsensor monitor bewaakt of de signaalrespons van de zuurstofsensor als gevolg van brandstofovergang overeenkomt met de juiste zuurstofsensorbank (Bank). Mogelijk oorzaken van deze storingscode zijn onder meer stekkers van de zuurstofsensor die door elkaar zijn gehaald, bedrading die door elkaar is gehaald, enz."
