		"zs": "De functie van de zuurstofsensor is om het zuurstofgehalte in het uitlaatgas van de motor te meten om de hoeveelheid brandstofinjectie te corrigeren, zodat de motor de beste lucht-brandstofverhouding kan verkrijgen. In de OBD-foutcode, u zult vaak het aantal rijen en nummers zien Zuurstofsensor Rij 1 verwijst naar de rij waar cilinder 1 zich bevindt, en de resterende rij is rij 2. Ongeacht welke rij, de eerste sensor verwijst altijd naar de stroomopwaartse zuurstofsensor (vóór de katalytische tank), verwijst de 2e sensor altijd naar de stroomafwaartse zuurstofsensor (na de katalytische tank). Deze foutcode treedt op wanneer de spanning van het signaal van de verwarmde zuurstofsensor gedurende een ingestelde tijd onder de 156 mV blijft. De oorzaak van de fout omvat de zuurstofsensor Verontreiniging door silicium in de brandstof, het signaal van de zuurstofsensor en de aardingsdraad kruisen elkaar, het signaalcircuit van de zuurstofsensor is kortgesloten naar aarde, de zuurstofsensor zelf is defect, de elektronische regelmodule (PCM of ECM) is defect enz."
