		"dm": "P0844",
		"des": "Transmissie Vloeistofdruk Sensor/Schakelaar A Circuit Onderbroken",
		"sys": "Versnellingsbak",
		"zs": "De schakelsolenoïdeklep regelt de hydraulische druk naar de transmissiekoppeling door de transmissievloeistofregelklep te openen of te sluiten om de ontkoppeling en inschakeling voor schakelen te regelen. Nauwkeurige regeling van de transmissievloeistofdruk is belangrijk voor soepel schakelen. De functie van de transmissievloeistofdruk (TFP) -sensor is om de transmissievloeistofdruk en het elektrische signaal naar de transmissieregelmodule (TCU) over te brengen als referentie voor de werking van de magneetklep voor de transmissievloeistofdrukregeling."
