	"P02B7": {
		"zzs": "Alle autofabrikanten",
		"dm": "P02B7",
		"des": "Cilinder 8 - Brandstofafstelling bij min. limiet",
		"sys": "Brandstof of lucht",
		"zs": "Brandstofafstelling is wanneer de elektronische regeleenheid (ECU) de brandstoftoevoer regelt door de openingstijd van de injectoren te verlengen of te verkorten, zodat de motor de optimale lucht-brandstofverhouding bereikt (14,7:1 lucht-benzinemassa ratio) De air-to-ramp ratio is te rijk voor te veel brandstoftoevoer en te mager voor te weinig brandstoftoevoer.Als de brandstofafstelling de minimumlimiet bereikt en langer dan een bepaalde tijd op de minimumlimiet blijft, verschijnt deze foutcode ."
	},
	"P0069": {
		"zzs": "Alle autofabrikanten",
		"dm": "P0069",
		"des": "Absolute druk spruitstuk - correlatie luchtdruk",
		"sys": "Brandstof-, lucht- of emissieregeling",
		"zs": "De Manifold Absolute Pressure (MAP)-sensor meet de druk (vacuüm) in het inlaatspruitstuk. De Powertrain Control Module (PCM) past vervolgens het verschil aan tussen de druk in het inlaatspruitstuk en de atmosferische druk. Het verschil (lineaire relatie met de motor belasting) wordt gebruikt als basis voor het bepalen van de basisbrandstofinjectiehoeveelheid van de injector om de motor te helpen de beste lucht-brandstofverhouding te bereiken onder verschillende belastingen. De barometrische druksensor (ook wel hoogtecompensator, HAC genoemd) wordt gebruikt om luchtdruk als een elektrisch signaal naar de elektronische regelmodule Luchtdruk varieert met weer en hoogte Hoe lager de druk, hoe ijler de lucht De Powertrain Control Module (PCM) De waarde van de druk wordt gebruikt om de brandstoftoevoer naar helpen de motor de beste lucht-brandstofverhouding te bereiken Als de elektronische regeleenheid (ECU) constateert dat het signaalverschil tussen de MAP-sensor (spruitstuk absolute druk) en de luchtdruksensor de ingestelde tijdsperiode (2,5 seconden) overschrijdt Kalibratiewaarde ( meestal 10.35KPa), zal deze foutcode verschijnen."
	},
	"P0363": {
		"zzs": "Alle autofabrikanten",
		"dm": "P0363",
		"des": "Misfire gedetecteerd - Tanken uitgeschakeld",
		"sys": "Ontstekingssysteem",
		"zs": "Cilindermisfire verwijst naar het fenomeen dat het mengsel om verschillende redenen tijdens de werking van de motor niet goed in de cilinder kan worden verbrand. Als de elektronische regeleenheid (ECU) een misfire detecteert, kan dit schade aan de katalysator veroorzaken converter, Het storingslampje gaat knipperen en de motor moet onmiddellijk worden uitgeschakeld. Deze foutcode geeft aan dat de elektronische regeleenheid (ECU) een ontstekingsfout heeft gedetecteerd. De brandstoftoevoer is beëindigd om schade aan de katalysator te voorkomen."
	},
	"P0159": {
		"zzs": "Alle autofabrikanten",
		"dm": "P0159",
		"des": "O2-sensorcircuit trage respons (bank 2, sensor 2)",
		"sys": "Brandstof of lucht",
		"zs": "De functie van de zuurstofsensor is om het zuurstofgehalte in het uitlaatgas van de motor te meten om de hoeveelheid brandstofinjectie te corrigeren, zodat de motor de beste lucht-brandstofverhouding kan verkrijgen. In de OBD-foutcode, u zult vaak het aantal rijen en nummers zien Zuurstofsensor Rij 1 verwijst naar de rij waar cilinder 1 zich bevindt, en de resterende rij is rij 2. Ongeacht welke rij, de eerste sensor verwijst altijd naar de stroomopwaartse zuurstofsensor (vóór de katalytische tank), de tweede sensor is altijd de stroomafwaartse zuurstofsensor (na de katalytische tank). De monitor van de verwarmde zuurstofsensor volgt de snelheid van spanningsverandering tijdens de stijging en daling van het zuurstofsensorsignaal. Wanneer de snelheid van spanningsverandering is lager is dan de gekalibreerde waarde, begint de elektronische regeleenheid (ECU) de lucht-brandstofverhouding te wijzigen in een poging de snelheid van de spanningsverandering van de zuurstofsensor te verhogen.Als de ECU de acceptabele brandstofafstellingslimiet heeft bereikt of heeft overschreden de acceptabele brandstofafstellingsduur en bewaakt nog steeds geen acceptabele spanning Als de veranderingssnelheid wordt gewijzigd, verschijnt deze DTC. Oorzaken van storing zijn onder meer vervuiling van de zuurstofsensor door silicium in de brandstof, open circuit in het signaalcircuit van de zuurstofsensor, storing van de zuurstofsensor zelf, lekkage in de uitlaatpijp of uitlaatspruitstuk, storing van de elektronische regelmodule (PCM of ECM). , enz."
	},
