		"des": "Secundair circuit brandstofpomp onderbroken",
		"sys": "Brandstof of lucht",
		"zs": "Het brandstofpompcircuit is verdeeld in een hoofdcircuit en een secundair circuit. Het hoofdcircuit is verantwoordelijk voor het regelen van de brandstofpomp en het brandstofpomprelais gebruikt de lage stroom van de elektronische regeleenheid (ECU) om de elektromagnetische spoel, waardoor de hoge stroom van de brandstofpomp wordt ingeschakeld.Het secundaire circuit verwijst naar het circuit van de brandstofpompmonitor (FPM), dat verantwoordelijk is voor het bewaken van de circuitfeedback van de brandstofpomp.De foutoorzaken van P0233 omvatten het circuit van de brandstofpompmonitor (FPM) tot het brandstofpomprelais, het brandstofpomprelaiscircuit, de brandstofpomprelais, elektronische regeleenheden (ECU's), enz."
