		"des": "Cruise control kustsignaal",
		"sys": "Voertuigsnelheid en stationair toerentalregeling",
		"zs": "Het cruise control-systeem (CRUISE CONTROL SYSTEM) stelt de bestuurder in staat om automatisch de snelheid van het voertuig aan te houden zonder het gaspedaal in te trappen. ) vond de cruise control COAST De (coast)-toets wordt niet ingedrukt. Oorzaken zijn onder meer cruise control-keuzeschakelaar, circuit, connector of elektronische regeleenheid (ECU)."
