		"zs": "De schakelsolenoïdeklep regelt de hydraulische druk naar de transmissiekoppeling door de transmissievloeistofregelklep te openen of te sluiten om de ontkoppeling en inschakeling voor schakelen te regelen. Nauwkeurige regeling van de transmissievloeistofdruk is belangrijk voor soepel schakelen. Het doel van de drukregelmagneetklep is om de druk van de transmissievloeistof te regelen.De oorzaak van de storing kan het circuit van de drukregelmagneetklep (pc) zijn, de connector of de magneetklep zelf.Een storing in de regelmodule kan er ook voor zorgen dat deze storingscode verschijnen."
