		"zs": "De rol van de krukas is om de op en neergaande beweging van de zuiger om te zetten in een roterende beweging. De rol van de nokkenas is om het openen en sluiten van de kleppen te regelen. De elektronische regeleenheid (ECU) continu bewaakt de timingpositie van de variabele nokkenas,Controleer de relatieve positie tussen de nokkenas en de krukas.Als de relatieve positie met meer dan 1 tand verkeerd is uitgelijnd, verschijnt deze foutcode.De oorzaken van de fout zijn de nokkenaspositiesensor zelf of de storing in het circuit en de krukaspositiesensor zelf of de storing in het circuit, de storing van de motortoerentalsensor, vervuilde olie, de magneetklep van de variabele nokkenas zit vast, enz."
