		"sys": "Brandstof of lucht",
		"zs": "De brandstoftemperatuursensor bewaakt de temperatuur van de brandstof naar de brandstofpomp om vapour lock als gevolg van een te hoge temperatuur (120 graden Celsius) te voorkomen, wat schade aan de brandstofpomp of injectoren kan veroorzaken. Als de elektronische regeleenheid ( ECU) continu detecteert dat de signaalspanning van de brandstoftemperatuursensor de normale waarde (0.21-4.54v) overschrijdt in de ingestelde tijdsperiode, dan zal de foutcode verschijnen.De oorzaak van de fout is het draaien van de motor wanneer de buitentemperatuur is te laag, de brandstoftemperatuursensor Circuit, connector of sensor zelf defect, elektronische regelmodule (PCM of ECM) defect, etc."
