		"des": "Catalyst temperatuursensor circuit hoog (bank 2, sensor 2)",
		"sys": "Emissiecontrole",
		"zs": "Een katalysator (ook wel katalysator genoemd) is een apparaat voor het zuiveren van uitlaatgassen dat de werking van een katalysator gebruikt om CO, HC en NOx in de uitlaat om te zetten in gassen die onschadelijk zijn voor het menselijk lichaam. vóór de geluiddemper in de uitlaatpijp. Deze storingscode geeft aan dat de circuitspanning van de temperatuursensor van de katalysator hoger is dan de gekalibreerde maximale waarde. Oorzaken van storing zijn onder meer een storing in de temperatuursensor, het circuit, de connector of de elektronische regeleenheid (ECU) van de katalysator."
