		"sys": "computer of hulpuitgangscircuit",
		"zs": "De motorregeleenheid, ook wel motorregeleenheid genoemd (sommige ingebouwde motorregelmodules en transmissieregelmodules zijn geïntegreerd in een regelmodule voor de aandrijflijn), bestuurt de werking van de gehele motor. De belangrijkste functie is om de optimale hoeveelheid brandstofinjectie en ontstekingstijdstip van de motor te regelen. Een andere belangrijke rol is het onderdeel dat verantwoordelijk is voor het bewaken van de uitlaatemissiecontrole."
