		"sys": "Brandstof-, lucht- of emissieregeling",
		"zs": "De rol van de nokkenas is het regelen van het openen en sluiten van de klep. In het variabele kleptimingsysteem verandert de elektronische nokkenasregelklep (of olieregelklep, OCV) de oliedruk naar de nokkenasregelaar (mechanisch) wordt gebruikt om de hoek van de nokkenas aan te passen om ervoor te zorgen dat de klep op het optimale moment opent en sluit. De storingsoorzaken van P0022 zijn onder meer een timing van de inlaat/linker/voornokkenas niet ingesteld. Het zit vast, de nokkenas zit mechanisch vast. of de actuatorklep zit vast in de open stand."
