		"sys": "Brandstof of lucht",
		"zs": "Brandstofafstelling is wanneer de elektronische regeleenheid (ECU) de brandstoftoevoer regelt door de openingstijd van de injectoren te verlengen of te verkorten, zodat de motor de optimale lucht-brandstofverhouding bereikt (14,7:1 lucht-benzinemassa verhouding) De lucht-brandstofverhouding is te rijk voor te veel brandstoftoevoer en te mager voor te weinig brandstoftoevoer. Deze foutcode verschijnt als de brandstofafstelling de maximale limiet bereikt en langer dan een bepaalde tijd blijft."
