		"zs": "De motorregeleenheid, ook wel motorregeleenheid genoemd (sommige ingebouwde motorregelmodules en transmissieregelmodules zijn geïntegreerd in een regelmodule voor de aandrijflijn), bestuurt de werking van de gehele motor. De belangrijkste functie is om de De optimale hoeveelheid brandstofinjectie en ontstekingstijdstip van de motor te regelen.Een andere belangrijke rol is het onderdeel dat verantwoordelijk is voor het bewaken van de uitlaatemissiecontrole.De koppelomvormer werkt als een koppeling in een handgeschakelde versnellingsbak, waardoor het koppel van de motor tijdelijk kan worden losgekoppeld van de transmissie. Het resultaat is soepel schakelen. Maar het verschil is dat de koppelomvormer kan werken als een terugschakeling om het koppel te verhogen."
