		"sys": "Aandrijflijnsysteem (gedefinieerd door de fabrikant)",
		"zs": "Een katalysator (ook wel katalysator genoemd) is een apparaat voor het zuiveren van uitlaatgassen dat de werking van een katalysator gebruikt om CO, HC en NOx in de uitlaat om te zetten in gassen die onschadelijk zijn voor het menselijk lichaam. voor de uitlaatdemper in de uitlaatpijp Brandstofafstelling is wanneer de elektronische regeleenheid (ECU) de brandstoftoevoer regelt door de tijd dat de injectoren open staan te verlengen of te verkorten, zodat de motor de optimale lucht-brandstofverhouding (lucht-benzinemassa) bereikt verhouding van 14,7:1). Een te rijke lucht-luchtverhouding betekent dat het brandstoftoevoervolume te groot is, en een te arme lucht-brandstofverhouding betekent dat het brandstoftoevoervolume te klein is."
