		"zs": "De functie van de condensor is om het koelmiddel vloeibaar te maken door warmte uit te wisselen met de lucht buiten het voertuig. De hogetemperatuur- en hogedrukkoelstoom van de compressor komt de condensor binnen via de hogedrukslang; aangezien de temperatuur buiten het voertuig is lager dan de temperatuur die de condensor binnenkomt Koelmiddeltemperatuur, met behulp van de condensatieventilator wordt de meeste warmte van het koelmiddel dat in de condensor stroomt, afgevoerd door de buitenlucht, zodat de hoge temperatuur en gas onder hoge druk wordt gecondenseerd tot een vloeistof met hoge temperatuur en hoge druk, die wordt gebruikt voor de daaropvolgende vergassing en koeling. Maak je klaar."
