		"dm": "P1086",
		"des": "Verwarmde zuurstofsensor 2 - boven magere limiet (bank 4)",
		"sys": "Aandrijflijnsysteem (gedefinieerd door de fabrikant)",
		"zs": "De functie van de zuurstofsensor is om het zuurstofgehalte in het uitlaatgas van de motor te meten om de hoeveelheid brandstofinjectie te corrigeren, zodat de motor de beste lucht-brandstofverhouding kan verkrijgen. In de OBD-foutcode, u zult vaak het aantal rijen en nummers zien Zuurstofsensor Rij 1 verwijst naar de rij waar cilinder 1 zich bevindt, en de resterende rij is rij 2. Ongeacht welke rij, de eerste sensor verwijst altijd naar de stroomopwaartse zuurstofsensor (vóór de katalytische tank), verwijst de 2e sensor altijd naar de stroomafwaartse zuurstofsensor (na de katalytische tank). De storingsoorzaken zijn onder meer luchtlekkage na de luchtmassasensor (MAF), lekkage van het PCV-systeem, defecte zuurstofsensor, uitlaatlekkage nabij de zuurstofsensor, EGR-lekkage, luchtstroom Defecte (MAF) sensor, vuil brandstoffilter, onvoldoende brandstoftoevoer naar de brandstofpomp, defecte brandstofdrukregelaar, verstopte injector, defecte motortoerentalsensor, defecte elektronische regelmodule (PCM of ECM), enz. ."
