		"sys": "Aandrijflijnsysteem (gedefinieerd door de fabrikant)",
		"zs": "De Idle Air Control (IAC)-klep heeft een beweegbare naaldklep die wordt bestuurd door een nauwkeurig bewegende stappenmotor. Met de gasklep gesloten, regelt de IAC-klep het stationaire toerental door de luchtstroom in de bypassleiding te wijzigen. geschikt voor stationair toerental onder verschillende omstandigheden."
