		"sys": "Aandrijflijnsysteem (gedefinieerd door de fabrikant)",
		"zs": "De functie van de krukas is om de op en neergaande beweging van de zuiger om te zetten in een roterende beweging. De krukaspositiesensor (CKP) (ook wel de bovenste dode punt genoemd) wordt gebruikt om het bovenste dode punt te detecteren (BDP) signaal en het krukashoeksignaal En het motortoerentalsignaal, en voer het in de computer in, zodat de computer het beste ontstekingstijdstipcommando kan sturen volgens de ontstekingsvolgorde van de cilinders. De redenen voor de storing zijn onder andere dat de krukaspositiesensor of aanverwante hardware is vervangen en de stappen voor het corrigeren van de foutcorrectie van het krukaspositietandwiel worden niet uitgevoerd."
