		"sys": "Aandrijflijnsysteem (gedefinieerd door de fabrikant)",
		"zs": "Het verdampingsemissiesysteem (EVAP) leidt benzinedampen van de brandstoftank naar een opslagtank met geactiveerde koolstof die benzinedampen absorbeert. De motor gebruikt vervolgens verse lucht om deze benzinedampen in de verbrandingskamer van de motor te spoelen. Lekken De De rol van de diagnosemodule is om de lekdetectiepomp (LDP) te gebruiken om een kleine druk uit te oefenen op het verdampingsemissiesysteem (EVAP) en het brandstofsysteem, en vervolgens te detecteren of er een lek in het systeem zit om ervoor te zorgen dat er geen schadelijke damp ontsnapt in de atmosfeer. De oorzaken van de storing zijn onder meer lekdetectiepomp (LDP) of het defect van het circuit of de connector, brandstoftankdop niet vastgedraaid, EVAP-bussysteempijpleiding of geldlekkage, EVAP-busontluchtingsregelklep defect, elektronische regelmodule (PCM of ECM) storing, etc."
