		"sys": "Aandrijflijnsysteem (gedefinieerd door de fabrikant)",
		"zs": "De koppelomvormer werkt als een koppeling in een handgeschakelde versnellingsbak, waardoor het koppel van de motor tijdelijk kan worden losgekoppeld van de transmissie voor soepel schakelen. Maar het verschil is dat de koppelomvormer kan fungeren als een koppelomvormer. en koppel zoals terugschakelen.De redenen voor het falen zijn onder meer het open circuit van het signaalcircuit van de TCC-vrijgaveschakelaar of het falen van de aandrijflijnbesturingsmodule (PCM), het beschadigde O-pad van de turbine-as, het falen van de TCC-regelklep of het mislukken van de 1e checkbal, etc.."
