		"zs": "Turbinesnelheidssensor (TSS), ook wel ingaande assnelheidssensor (ISS) genoemd, zijn functie is om de snelheid van de ingaande as (dat wil zeggen de koppelomvormer) over te brengen naar de transmissieregelmodule (TCU) in de vorm van frequentie. Het aanpassen van de koppelomvormer lockup koppeling is bijzonder kritisch. De snelheidssensor van de uitgaande as (OSS) wordt ook wel de snelheidssensor van het voertuig (VSS) genoemd, en het is zijn taak om het snelheidssignaal van de uitgaande as van de transmissie naar de besturingseenheid als belangrijke basis voor schakelen."
