		"sys": "Aandrijflijnsysteem (gedefinieerd door de fabrikant)",
		"zs": "De Manifold Absolute Pressure (MAP)-sensor meet de druk (vacuüm) in het inlaatspruitstuk. De Powertrain Control Module (PCM) past vervolgens het verschil aan tussen de druk in het inlaatspruitstuk en de atmosferische druk. Het verschil (lineaire relatie met de motor belasting) wordt gebruikt als basis voor het bepalen van de basisbrandstofinjectiehoeveelheid van de injector om de motor te helpen de beste lucht-brandstofverhouding te bereiken onder verschillende belastingen. De turbocompressor gebruikt de traagheidsimpuls van het uitlaatgas dat uit de motor wordt afgevoerd om de turbine aan te drijven , drijft de turbine de coaxiale waaier aan om de inlaatlucht onder druk te zetten, waardoor het vermogen van de auto toeneemt. De supercharger-sensor, ook wel de boost-druksensor (BPS) genoemd, wordt gebruikt om de supercharge-druk door te geven aan de elektronische besturing in de vorm van een elektrische signaaleenheid (ECU)."
