		"des": "Alternatorveldcircuit - Signaal buiten bereik",
		"sys": "Aandrijflijnsysteem (gedefinieerd door de fabrikant)",
		"zs": "De functie van de generator is om een deel van de mechanische energie van de automotor om te zetten in elektrische energie die de auto zelf kan gebruiken en om de accu op te laden. De generator heeft meestal 5 aansluitingen: S-aansluiting - monitor accuspanning , IG-aansluiting - verantwoordelijk voor het inschakelen van de contactschakelaar voor de spanningsregelaar, L-aansluiting - sluit het circuit naar het waarschuwingslampje, B-aansluiting - uitgangsaansluiting van de hoofdgenerator (aangesloten op de accu), F-aansluiting - veldbypass voor de spanningsregelaar De methode van een veelgebruikte diagnostische generator is het meten van de accuspanning voor en nadat de motor start. Normaal gesproken is de spanning voor het starten ongeveer 12 volt. De spanning na het starten moet ongeveer 14 volt zijn."
