		"zs": "Wanneer de koelvloeistoftemperatuur een bepaald instelpunt bereikt (bijvoorbeeld wanneer de airconditioning aanstaat en de auto stilstaat), activeert de Powertrain Control Module (PCM) de koelvloeistofventilator om hem te helpen afkoelen. "
