		"sys": "Aandrijflijnsysteem (gedefinieerd door de fabrikant)",
		"zs": "De functie van de brandstofpomp is om de brandstof uit de brandstoftank te zuigen, onder druk te zetten en naar de brandstoftoevoerleiding te voeren, en samen te werken met de brandstofdrukregelaar om een bepaalde brandstofdruk tot stand te brengen. De brandstofpomp relais gebruikt de kleine stroom van het contactslot om de elektromagnetische spoelaanzuiging van de brandstofpomp te genereren, combineert de hoge stroomlijnen van de brandstofpomp, waardoor de brandstofpomp start."
