		"des": "Actuator nokkenaspositie, bank 2 - defect",
		"sys": "Aandrijflijnsysteem (gedefinieerd door de fabrikant)",
		"zs": "De rol van de nokkenas is het regelen van het openen en sluiten van de klep. In het variabele kleptimingsysteem verandert de elektronische nokkenasregelklep (of olieregelklep, OCV) de De hoek van de nokkenas wordt aangepast door middel van oliedruk naar de nokkenasversteller (mechanisch) om ervoor te zorgen dat de klep op het optimale moment opent en sluit. Deze DTC duidt op een storing van de nokkenaspositieactuator."
