		"sys": "Aandrijflijnsysteem (gedefinieerd door de fabrikant)",
		"zs": "De motorregeleenheid, ook wel motorregeleenheid genoemd (sommige ingebouwde motorregelmodules en transmissieregelmodules zijn geïntegreerd in een regelmodule voor de aandrijflijn), bestuurt de werking van de gehele motor. De belangrijkste functie is om de De optimale hoeveelheid brandstofinjectie en ontstekingstijdstip van de motor te regelen.Een andere belangrijke rol is het onderdeel dat verantwoordelijk is voor het bewaken van de uitlaatemissiecontrole.In het elektronische gasklepsysteem (ETC) is de elektronische regelmodule (ECU) gebaseerd op het gaspedaal positiesensor (APP). Signalen, evenals motortoerental, voertuigsnelheid, energieverbruik van de airconditioning, enz., om de gasklepstandmotor te instrueren om de gasklepopening te optimaliseren."
