		"zs": "De rol van de nokkenas is het regelen van het openen en sluiten van de klep. In het variabele kleptimingsysteem verandert de elektronische nokkenasregelklep (of olieregelklep, OCV) de oliedruk naar de nokkenasregelaar (mechanisch) past de hoek van de nokkenas aan om ervoor te zorgen dat de klep op het optimale moment opent en sluit. Als de spanning van de (uitlaat/rechts/achter) nokkenasverstelklep hoger is dan de gekalibreerde maximale waarde die de elektronische regeleenheid (ECU) ) beschouwt het stuurcircuitsegment als positief."
