		"sys": "Aandrijflijnsysteem (gedefinieerd door de fabrikant)",
		"zs": "De rol van de nokkenas is het regelen van het openen en sluiten van de klep. In het variabele kleptimingsysteem verandert de elektronische nokkenasregelklep (of olieregelklep, OCV) de oliedruk naar de nokkenasregelaar (mechanisch) wordt gebruikt om de hoek van de nokkenas aan te passen om ervoor te zorgen dat de klep op het optimale moment opent en sluit. Als de spanning van het regelcircuit van de B-nokkenasverstelling buiten het gekalibreerde normale bereik valt, verschijnt de foutcode."
