		"sys": "Aandrijflijnsysteem (gedefinieerd door de fabrikant)",
		"zs": "De accutemperatuursensor bevindt zich aan de onderkant van de accubak van de auto. Zijn belangrijkste functie is het verzenden van de accutemperatuur als een elektrisch signaal naar de Electronic Control Unit (ECU) om de laadsnelheid te helpen bepalen."
