		"zs": "De gasklep, algemeen bekend als het gaspedaal, is een regelbare klep die wordt gebruikt om het inlaatluchtvolume van de motor te regelen. In het elektronische gasklepsysteem (ETC) is de elektronische regelmodule (ECU) gebaseerd op de positie van het signaal van de gaspedaalsensor (APP), evenals het motortoerental, de voertuigsnelheid, het energieverbruik van de airconditioning, enz., om de gasklepstandmotor te instrueren om de gasklepopening te optimaliseren."
