		"zs": "De functie van het dieselroetfilter (DPF) is het verwijderen van verontreinigende deeltjes en roet uit de dieseluitlaat. Het dieselroetfilter (DPF) is over het algemeen verdeeld in twee typen: hernieuwbaar en niet-hernieuwbaar. Hernieuwbaar roetfilter Het filter is over het algemeen geregenereerd door hoge temperaturen of door deeltjes te oxideren met stikstofoxiden.De functie van de druktransmitter van het roetfilter (DPF) is het voorkomen van schade aan de motor als gevolg van te hoge druk veroorzaakt door de verstopping van het roetfilter, en het voorkomen van schade aan de motor. Biedt diagnostiek voor roetfilterregeneratie."
