		"zs": "De inlaatspruitstukluchtregeling (IMAC) bevindt zich tussen het inlaatspruitstuk en de cilinderkop. Om de motorprestaties te verbeteren, komt elke cilinder overeen met twee inlaatkanalen, waarvan er één altijd open is, de andere alleen opent wanneer de snelheid boven een bepaalde waarde ligt (zeg 3000 RPM). De rol van de IMAC-uitvoeringsmotor is het openen/sluiten van de klepklep van de inlaatdoorgang volgens het commando van de elektronische regeleenheid (ECU)."
