		"sys": "Aandrijflijnsysteem (gedefinieerd door de fabrikant)",
		"zs": "De Idle Air Control (IAC)-klep heeft een beweegbare naaldklep die wordt bestuurd door een nauwkeurig bewegende stappenmotor. Met de gasklep gesloten regelt de IAC-klep het stationaire toerental door de luchtstroom in de bypassleiding te wijzigen. aanpassen aan stationair toerental onder verschillende omstandigheden.Deze DTC geeft aan dat de Powertrain Control Module (PCM) detecteert dat het werkelijke stationair toerental 100 - 200 tpm hoger is dan het opgedragen stationair toerental. Oorzaken van storing zijn onder meer een inlaatsysteem dat lekt in de buurt van EGR of PCV, brandstoftoevoer Systeemstoring, defecte motorophanging, defecte gasklepbedrading, vuil gasklephuis, defecte regelklep voor stationair toerental, enz."
