		"zs": "In het Electronic Throttle (ETC)-systeem bestuurt de gasklepregelmodule (ECU) de gasklepstandmotor op basis van het signaal van de gaspedaalstandsensor (APP) en het motortoerental, voertuigsnelheid, airconditioningenergie verbruik, enz. Om de gasklepopening te optimaliseren De motorregeleenheid, ook wel de motorregeleenheid genoemd (sommige ingebouwde motorregelmodules en transmissieregelmodules zijn geïntegreerd in een aandrijflijnregelmodule), regelt de werking van de gehele motor. De belangrijkste rol is het regelen van de optimale hoeveelheid brandstofinjectie en het ontstekingstijdstip van de motor. Een andere belangrijke rol is het bewaken van de componenten van de uitlaatemissiecontrole."
