		"sys": "Aandrijflijnsysteem (gedefinieerd door de fabrikant)",
		"zs": "De motorregeleenheid, ook wel motorregeleenheid genoemd (sommige ingebouwde motorregelmodules en transmissieregelmodules zijn geïntegreerd in een regelmodule voor de aandrijflijn), bestuurt de werking van de gehele motor. De belangrijkste functie is om de optimale brandstofinjectiehoeveelheid en het ontstekingstijdstip van de motor te regelen. Een andere belangrijke rol is het onderdeel dat verantwoordelijk is voor het bewaken van de uitlaatemissiecontrole. De Idle Air Control (IAC)-klep heeft een beweegbare naaldklep die wordt aangestuurd door een nauwkeurig bewegende stappenmotor. Aan de gasklep In gesloten toestand regelt de IAC-klep het stationair toerental door de luchtstroom in de bypassleiding te veranderen om zich aan te passen aan het stationair toerental onder verschillende omstandigheden."
