		"des": "PCV-slang - defect/losgekoppeld (bank 1)",
		"sys": "Aandrijflijnsysteem (gedefinieerd door de fabrikant)",
		"zs": "De functie van het positieve carterventilatiesysteem (PCV) is om het doorblaasgas in het carter om te leiden (aan het einde van het verbrandingsproces van de motor lekt er een onverbrand mengsel uit de zuigerveren in het carter onder hoge druk). druk, deze lekkage wordt in de industrie blow-by gas genoemd) wordt in het inlaatspruitstuk geïntroduceerd door het vacuüm dat wordt gegenereerd door de werking van de motor, en dan zal het blow-by gas de cilinder binnendringen met de frisse lucht en worden verbrand, waardoor de vervuiling wordt verminderd en de motorefficiëntie wordt verbeterd."
