		"zs": "De functie van de zuurstofsensor is om het zuurstofgehalte in het uitlaatgas van de motor te meten om de hoeveelheid brandstofinjectie te corrigeren, zodat de motor de beste lucht-brandstofverhouding kan verkrijgen. In de OBD-foutcode, u zult vaak het aantal rijen en nummers zien Zuurstofsensor Rij 1 verwijst naar de rij waar cilinder 1 zich bevindt, en de resterende rij is rij 2. Ongeacht welke rij, de eerste sensor verwijst altijd naar de stroomopwaartse zuurstofsensor (vóór de katalytische tank), De tweede sensor verwijst altijd naar de stroomafwaartse zuurstofsensor (na de katalytische tank). Lambda is een andere manier om de lucht-brandstofverhouding uit te drukken (een lambda gelijk aan 1 komt overeen met een lucht-brandstofverhouding van 14,7: 1, hoe groter de lambda, de lucht-brandstofverhouding Leaner) Oorzaken van storing zijn onder meer luchtlek achter luchtstroom (MAF) sensor, PCV-systeemlek, zuurstofsensor defect, uitlaatlek nabij zuurstofsensor, EGR-lek, luchtstroom (MAF ) sensorstoring, vervuild brandstoffilter, onvoldoende brandstoftoevoer naar de brandstofpomp, storing van de brandstofdrukregelaar, geblokkeerde injector, storing van de motortoerentalsensor, storing van de elektronische regelmodule (PCM of ECM), etc."
