		"zs": "De elektronische regelmodule detecteert cilinderstoringen door veranderingen in de rotatiesnelheid van de krukas te bewaken. Veranderingen in de wielsnelheid veroorzaakt door slechte wegomstandigheden kunnen echter ook veranderingen in de krukassnelheid veroorzaken, wat de detectie van cilinderstoringen kan beïnvloeden. Antiblokkeersysteem (ABS) en het tractiecontrolesysteem (TCS) kunnen via het signaal van de wielsnelheidssensor beoordelen of het voertuig op slechte wegomstandigheden rijdt.Als het systeem slechte wegomstandigheden detecteert die de detectie van ontstekingsfouten ernstig beïnvloeden, het zal de elektronische regelmodule op de hoogte stellen om de detectie van ontstekingsfouten uit te schakelen om te voorkomen dat er een foutbericht met opnamefouten wordt weergegeven. Controleer het circuit tussen de motorregeleenheid (ECM) en het antiblokkeersysteem (ABS)."
