		"zs": "De brandstofdrukregelaar gebruikt een door een veer aangedreven klep om overtollige benzine terug naar de tank te laten stromen, waardoor een constante druk in het brandstofcircuit wordt gehandhaafd. De brandstofdrukregelaar heeft een vacuümleiding die is aangesloten op de inlaat. Zorg voor overeenkomstige benzinedruk onder verschillende motorbedrijfsomstandigheden (motorbelasting beoordelen op basis van de mate van vacuüm).De meeste auto's brandstofdrukregelaars bevinden zich op de brandstofaftakleiding, maar de brandstofdrukregelaars van sommige auto's bevinden zich in de brandstoftank.De redenen voor de storing zijn onder meer de brandstofdrukregelklep regelcircuit open circuit of open circuit naar de minpool, de brandstofdrukregelklep zelf defect, de elektronische regelmodule (ECM of PCM) defect, etc."
