		"zs": "De functie van de zuurstofsensor is om het zuurstofgehalte in het uitlaatgas van de motor te meten om de hoeveelheid brandstofinjectie te corrigeren, zodat de motor de beste lucht-brandstofverhouding kan verkrijgen. In de OBD-foutcode, u zult vaak het aantal rijen en nummers zien Zuurstofsensor Rij 1 verwijst naar de rij waar cilinder 1 zich bevindt, en de resterende rij is rij 2. Ongeacht welke rij, de eerste sensor verwijst altijd naar de stroomopwaartse zuurstofsensor (vóór de katalytische tank), De tweede sensor verwijst altijd naar de stroomafwaartse zuurstofsensor (na de katalytische tank). Lambda is een andere manier om de lucht-brandstofverhouding uit te drukken (een lambda gelijk aan 1 komt overeen met een lucht-brandstofverhouding van 14,7: 1, hoe groter de lambda, hoe slanker de lucht-brandstofverhouding. Storingsoorzaken zijn onder meer defecte inlaatluchtstroomsensor of MAP-sensor (spruitstuk absolute druk), brandstofdruk te hoog, defecte brandstofdrukregelaar, defecte brandstofinjector, defecte zuurstofsensor, nokkenas timing fout, olie te vol, verdampingsemissiesysteem fout, elektronische regelmodule (PCM of ECM) storing, etc."
