		"zs": "De ontstekingsregelmodule is een solid-state schakelapparaat dat de werking van de bobine regelt. Mogelijke locaties voor de ontstekingsregelmodule zijn buiten de motor, in de verdeler of geïntegreerd met de aandrijflijnregelmodule (PCM) De functie van de bobine is om de 12 volt van de accu van de auto om te zetten in duizenden of zelfs tienduizenden volt die nodig zijn voor het ontsteken van de bougie.Er zijn twee sets spoelen in de bobine, de primaire spoel en de secundaire spoel. spoel heeft dikkere geëmailleerde draad, het aantal windingen is minder; de secundaire spoel gebruikt dunnere geëmailleerde draad en het aantal windingen is relatief groot. Wanneer de primaire spoel wordt ingeschakeld, wordt er een sterk magnetisch veld gegenereerd rond met de toename van de stroom, en de ijzeren kern slaat de magnetische veldenergie op; Wanneer het schakelapparaat het primaire spoelcircuit opent, vervalt het magnetische veld van de primaire spoel snel en induceert de secundaire spoel een hoge spanning."
