		"zs": "Hybride voertuigen hebben een Coolant Thermal Storage Tank (CHS). Wanneer de motor moet starten, activeert de Electronic Control Unit (ECU) de waterpomp om hete koelvloeistof aan de motor te leveren om de cilinderkoppen voor te verwarmen. Dit kan vermijd een rijke lucht-brandstofverhouding tijdens koude start, waardoor brandstof wordt bespaard.De rol van de koelvloeistofstroomregelklep is om koelvloeistof tussen de cilinderkop en de thermische opslagtank te laten circuleren tijdens het opwarmen, en na normaal gebruik koelvloeistof toe te laten Stroming tussen de cilinderkop en de verwarming van de thermische opslagtank. De positiesensor van de koelvloeistofstroomregelklep gebruikt het principe van een potentiometer om de koelvloeistofregelkleppositie als spanning door te geven aan de elektronische regeleenheid (ECU)."
