		"des": "Reductantspoelregelklep zit open",
		"sys": "Brandstof-, lucht- of emissieregeling",
		"zs": "Diesel Exhaust Fluid (DEF), ook wel reductiemiddel genoemd, is een mengsel van 32,5% ureum en water. Wanneer het in de uitlaat wordt geïnjecteerd, kan het stikstofoxiden omzetten in onschadelijk stikstof en water. Reductie De pomp van het middel assemblage bevat een drukpomp, een druksensor, een ontluchtingsklep, een uitlaatfilter en een intern verwarmingselement.De rol van de reductantdruksensor is om de pompsnelheid voor de PCM te regelen door middel van pulsbreedtemodulatie (PCM), waardoor de systeemdruk om feedback te geven. Wanneer de PCM om reductantinjectie vraagt, gaat de reductantinjector open en draait de pomp, waardoor druk wordt uitgeoefend op de oorspronkelijke drukleiding en injectoren en lucht uit het systeem wordt verwijderd. Wanneer alle lucht is verwijderd, wordt brandstof geïnjecteerd. De pomp wordt uitgeschakeld en de pomp levert een druk van ongeveer 500 kPa ter voorbereiding op de injectie van het reductiemiddel."
