		"sys": "Brandstof-, lucht- of emissieregeling",
		"zs": "De rol van de sensor voor de inlaatluchttemperatuur (IAT) is om de inlaatluchttemperatuur van de motor naar de elektronische regeleenheid (ECU) te sturen in de vorm van een spanningssignaal om een referentie te bieden voor brandstofinjectiecorrectie. "
