		"des": "Turbocompressor snelheidssensor circuitbereik/prestaties",
		"sys": "Aux-ingang",
		"zs": "De turbocompressor gebruikt het traagheidsmomentum van het uitlaatgas dat uit de motor komt om de turbine te duwen, die op zijn beurt de coaxiale waaier aandrijft om de inlaatlucht onder druk te zetten, waardoor het vermogen van de auto toeneemt. De functie van de turbocompressor snelheidssensor is om de turbine om te zetten. Het toerental wordt in de vorm van een elektrisch signaal naar de Electronic Control Unit (ECU) gestuurd."
