		"des": "Inlaatspruitstuk Runner Positie Sensor/Schakelaar Circuit Bereik/Prestaties (Bank 2)",
		"sys": "Brandstof-, lucht- of emissieregeling",
		"zs": "De inlaatspruitstukdoorgangscontrole (IMRC)-constructie bevindt zich tussen het inlaatspruitstuk en de cilinderkop. Om de motorprestaties te verbeteren, komt elke cilinder overeen met twee inlaatdoorgangen, waarvan er één altijd open is en de andere alleen opengaat wanneer de snelheid hoger is dan een bepaalde waarde (zeg 3000 RPM). De rol van de doorgangspositiesensor van het inlaatspruitstuk is om de opening van de doorgangsklep door te geven aan de elektronische regeleenheid (ECU) in de vorm van een elektrisch signaal. "
