		"dm": "P2188",
		"des": "Systeem te rijk bij inactiviteit (Bank 1)",
		"sys": "Brandstof-, lucht- of emissieregeling",
		"zs": "Brandstofafstelling is wanneer de elektronische regeleenheid (ECU) de brandstoftoevoer regelt door de openingstijd van de injectoren te verlengen of te verkorten, zodat de motor de optimale lucht-brandstofverhouding bereikt (14,7:1 lucht-benzinemassa verhouding) .De lucht-brandstofverhouding is te rijk betekent dat de brandstoftoevoer te groot is, en de lucht-brandstofverhouding is te mager betekent de brandstoftoevoer te klein.Het systeem is te rijk betekent het brandstofvolume (relatieve inlaatlucht volume) is te hoog. De oorzaak van de storing is de inlaatluchtstroomsensor of defecte spruitstuk absolute druk (MAP) sensor, brandstofdruk te hoog, brandstofdrukregelaar defect, injector defect, zuurstofsensor defect, nokkenas timing fout, olie overvuld , Systeemfout verdampingsemissie, storing elektronische regelmodule (PCM of ECM), enz."
