		"sys": "Emissiecontrole",
		"zs": "De functie van het dieselroetfilter (DPF) is het verwijderen van verontreinigende deeltjes en roet uit de dieseluitlaat. Dieselroetfilter (DPF) is over het algemeen verdeeld in twee typen: hernieuwbaar en niet-hernieuwbaar. Vernieuwbaar roetfilter Over het algemeen is de filter wordt geregenereerd door hoge temperatuur of door deeltjes te oxideren met stikstofoxiden.De rol van de dieselroetfilter (DPF) druksensor is om schade aan de motor te voorkomen als gevolg van overmatige druk veroorzaakt door de verstopping van het roetfilter, en aan de roetfilter filter. Regeneratie zorgt voor diagnose."
