	"P2546": {
		"zzs": "Alle autofabrikanten",
		"dm": "P2546",
		"des": "Koppelbeheer verzoek ingangssignaal A laag",
		"sys": "Aux-ingang",
		"zs": "De functie van het koppelbeheersysteem is om het koppel van de motor te verminderen door de brandstofinjector tijdelijk te sluiten of de ontsteking te vertragen tijdens het schakelen van de transmissie of het slippen van de wielen, om het schakelen soepeler te laten verlopen en de slijtage van de aandrijflijn."
	},
	"P2187": {
		"zzs": "Alle autofabrikanten",
		"dm": "P2187",
		"des": "Systeem te mager bij inactiviteit (bank 1)",
		"sys": "Brandstof-, lucht- of emissieregeling",
		"zs": "Brandstofafstelling is wanneer de elektronische regeleenheid (ECU) de brandstoftoevoer regelt door de openingstijd van de injectoren te verlengen of te verkorten, zodat de motor de optimale lucht-brandstofverhouding bereikt (14,7:1 lucht-benzinemassa verhouding). De lucht-luchtverhouding is te rijk betekent dat de brandstoftoevoer te groot is, en de lucht-luchtverhouding is te mager betekent dat de brandstoftoevoer te klein is. Het systeem is te arm betekent dat de brandstofhoeveelheid (relatieve luchtinlaat) is laag.De oorzaken van de storing zijn onder meer luchtstroom (MAF) luchtlek achter de sensor, PCV-systeemlek, zuurstofsensorstoring, uitlaatlek nabij de zuurstofsensor, EGR-lek, vuile luchtstroom (MAF ) sensor, verstopte injector, onvoldoende brandstofpomptoevoer, etc."
	},
