		"des": "Secundair luchtinjectiesysteem Luchtstroom-/druksensorcircuit laag (bank 2)",
		"sys": "Emissiecontrole",
		"zs": "Als de motor net is gestart, oxideert het secundaire luchtinjectiesysteem de gegenereerde koolwaterstoffen, koolmonoxide en andere schadelijke gassen door lucht in het uitlaatspruitstuk te persen. Dit proces versnelt ook het opwarmen van de katalysator."
