		"dm": "P2307",
		"des": "Bobine C primair regelcircuit hoog",
		"sys": "Ontstekingssysteem",
		"zs": "De rol van de bobine is om de 12-volt spanning van de accu van de auto om te zetten in duizenden of zelfs tienduizenden volt die nodig is voor het ontsteken van de bougie. Er zijn twee sets spoelen in de bobine, de primaire spoel en de secundaire spoel. De primaire spoel heeft een dikkere geëmailleerde draad met minder windingen; de secundaire spoel gebruikt een dunnere geëmailleerde draad, die relatief meer windingen heeft. Wanneer de primaire spoel wordt ingeschakeld, wordt er een sterk magnetisch veld omheen gegenereerd terwijl de stroom neemt toe en de ijzeren kern slaat magnetische veldenergie op; wanneer het schakelapparaat het primaire spoelcircuit opent, vervalt het magnetische veld van de primaire spoel snel en wordt een hoge spanning geïnduceerd in de secundaire spoel."
