	"P207B": {
		"zzs": "Alle autofabrikanten",
		"dm": "P207B",
		"des": "Intake Manifold Tuning (IMT) Kleppositiesensor/Schakelaar Circuit Bereik/Prestaties (Bank 2)",
		"sys": "Brandstof-, lucht- of emissieregeling",
		"zs": "Als de lengte van de doorlaat van het inlaatspruitstuk (runner) optimaal is, zal de drukgolf die wordt gegenereerd door het sluiten van de klep helpen om het olie-luchtmengsel in de motor te leiden. Het probleem is dat de optimale doorlaat van het inlaatspruitstuk voor verschillende motortoerentallen is ook anders. De rol van de inlaatklep (MTV) is het optimaliseren van het koppel van de motor bij verschillende snelheden door de inlaatlucht in de doorgangen van het inlaatspruitstuk van verschillende lengtes te leiden, afhankelijk van het motortoerental."
	},
