		"sys": "Versnellingsbak",
		"zs": "De transmissiebereiksensor is verantwoordelijk voor het doorgeven van de stand van de transmissiehendel (PRNDL) aan de elektronische regeleenheid (ECU) in de vorm van een elektrisch signaal. Deze foutcode geeft aan dat het A/B-signaal van de zendbereiksensor is inconsistent."
