		"sys": "Versnellingsbak",
		"zs": "Turbine Speed Sensor (TSS), ook bekend als Input Shaft Speed Sensor (ISS), zijn functie is om de snelheid van de input-as (dat wil zeggen, de koppelomvormer) over te brengen naar de transmissiecontrolemodule (TCU) in de vorm van frequentie), is deze informatie vooral cruciaal voor het afstellen van de koppelomvormer met overbruggingskoppeling."
