		"dm": "P264A",
		"des": "Een circuit van de positiesensor van de tuimelaaractuator (bank 1)",
		"sys": "Computer- of hulpuitgang",
		"zs": "In een systeem met variabele kleptiming is de tuimelaar een apparaat dat de nokkenas en de klep verbindt. De elektronische regelmodule kan de hoek van de nokkenas aanpassen door de oliedruk naar de tuimelaaractuator te wijzigen om ervoor te zorgen dat de kleppen openen en sluiten op het optimale moment. Dit optimaliseert de motorefficiëntie en het vermogen in alle toerentallen."
