		"sys": "Brandstof-, lucht- of emissieregeling",
		"zs": "De functie van de zuurstofsensor is om het zuurstofgehalte in het uitlaatgas van de motor te meten om de hoeveelheid brandstofinjectie te corrigeren, zodat de motor de beste lucht-brandstofverhouding kan verkrijgen. In de OBD-foutcode, u zult vaak het aantal rijen en nummers zien Zuurstofsensor Rij 1 verwijst naar de rij waar cilinder 1 zich bevindt, en de resterende rij is rij 2. Ongeacht welke rij, de eerste sensor verwijst altijd naar de stroomopwaartse zuurstofsensor (vóór de katalytische tank), De tweede sensor verwijst altijd naar de stroomafwaartse zuurstofsensor (na de katalytische tank). Deze foutcode geeft aan dat de elektronische regeleenheid (ECU) een fout heeft gedetecteerd in het 5 volt referentiespanningscircuit van de zuurstofsensor. De oorzaak van de storing is onder meer het 5 volt referentiespanningscircuit van de zuurstofsensor naar een bepaalde Een kortgesloten of kortgesloten circuit van één sensor, een kortgesloten of open circuit van een of meer sensoren, een ECU, enz."
