		"sys": "Versnellingsbak",
		"zs": "De transmissievloeistoftemperatuursensor (TFT) zendt de transmissievloeistoftemperatuur naar de elektronische regeleenheid (ECU) in de vorm van een elektrisch signaal op basis van het principe van de thermistor. De belangrijkste functie is dat wanneer de temperatuur te hoog, zal de transmissiecontrolemodule (TCU) terugschakelen om te vertragen. Voor sommige nieuwe auto's gebruikt de TCU dit temperatuursignaal om de viscositeit van de transmissievloeistof te bepalen, waardoor de leidingdruk en de magneetklepdruk worden aangepast. "
