		"des": "Auxiliary Transmissie Vloeistofpomp Regelcircuit laag",
		"sys": "Versnellingsbak",
		"zs": "De functie van de transmissievloeistofpomp is om werkdruk te leveren aan de transmissievloeistof wanneer de motor werkt. De schakelmagneetklep regelt de hydraulische druk naar de transmissiekoppeling door de transmissievloeistofregelklep te openen of te sluiten om door de scheiding en aangrijping wordt schakelen tussen versnellingen daardoor bereikt. Het doel van de hulptransmissievloeistofpomp is om druk uit te oefenen op de transmissievloeistof wanneer de motor niet draait (zoals bij het trekken van een aanhangwagen) om te voorkomen dat de transmissie oververhit raakt. "
