		"dm": "P203F",
		"des": "Reductantniveau te laag",
		"sys": "Brandstof-, lucht- of emissieregeling",
		"zs": "Diesel Exhaust Fluid (DEF), ook wel reductiemiddel genoemd, is een mengsel van 32,5% ureum en water. Wanneer het in de uitlaat wordt geïnjecteerd, kan het stikstofoxiden omzetten in onschadelijk stikstof en water. Verlaging Het niveau van het middel sensor bevat vier roestvrijstalen elektroden, waarvan er drie verticaal zijn geplaatst om signalen van hoog, gemiddeld en laag niveau te leveren. De vierde elektrode fungeert als aarde. Wanneer de reductanttank vol is, schakelt DEF alle drie de elektroden uit en aardt een elektrisch circuit tussen de elektroden, wat aangeeft dat de tank vol is. De elektroden worden achtereenvolgens blootgesteld terwijl de DEF geleidelijk wordt verbruikt en het niveau daalt. De Electronic Control Module (PCM) berekent het niveau van de DEF op basis van deze signalen."
