		"des": "Schakelvork C Positie circuit laag",
		"sys": "Versnellingsbak",
		"zs": "Bij een handgeschakelde versnellingsbak is het doel van de schakelvork om onder invloed van de schakelhendel heen en weer te bewegen om de gewenste versnellingsset te activeren."
