		"zs": "Wanneer de temperatuur van het dieseluitlaatsysteem hoog genoeg is, kan het roetfilter (DPF) passief worden geregenereerd (door de koolstofafzettingen op het filter te oxideren). Wanneer de temperatuur van het uitlaatsysteem niet hoog genoeg is, het kan actieve DPF-regeneratie doorstaan door een kleine hoeveelheid brandstof stroomopwaarts van de dieseloxidatiekatalysator (DOC) te injecteren om de temperatuur van het uitlaatsysteem te verhogen. Merk op dat deze geïnjecteerde brandstof niet verbrandt in het uitlaatsysteem. "
