		"zs": "De rol van de stikstofoxidesensor is om het stikstofoxidegehalte in het uitlaatgas door te geven aan de regeleenheid van de aandrijflijn (PCM) in de vorm van een elektrisch signaal, waardoor feedback wordt gegeven voor de verbranding om het stikstofniveau te verlagen emissie van oxideverontreinigende stoffen."
