		"sys": "Brandstof-, lucht- of emissieregeling",
		"zs": "In het elektronische gasklepbedieningssysteem (ETC) is de rol van de gaspedaalpositiesensor (APP) het doorgeven van de stand van het gaspedaal aan de gasklepregelmodule in de vorm van een elektrisch signaal, als een gasklepactuator om de gasklep te regelen Referentiebasis voor het openen van de klep.De gasklepactuator is een stappenmotor, die verantwoordelijk is voor het regelen van de opening van de gasklep volgens de instructies van de gasregelmodule.De oorzaak van de storing omvat de gasklepactuator regelmotor (TACM) circuit of gezamenlijke storing, het gasklephuis zit vast, de elektronische regelmodule (PCM of ECM) is defect, enz. Het wordt aanbevolen om de foutcode te wissen.Als dezelfde foutcode opnieuw verschijnt, zal de elektronische besturing module moet worden vervangen."
