	"P242B": {
		"zzs": "Alle autofabrikanten",
		"dm": "P242B",
		"des": "Uitlaatgastemperatuursensor Circuit Bereik/Prestaties (Bank 1 Sensor 3)",
		"sys": "Emissiecontrole",
		"zs": "De functie van de uitlaatgastemperatuursensor is om de uitlaatgastemperatuur in de vorm van een elektrisch signaal naar de elektronische regeleenheid (ECU) te sturen. De uitlaatgastemperatuur die wordt gegenereerd door de juiste lucht-brandstofverhouding is hoger dan de uitlaatgastemperatuur die wordt gegenereerd door de te rijke of te arme lucht-brandstofverhouding. Lage luchttemperatuur. Een te hoge uitlaattemperatuur (>160°C) kan de motor beschadigen."
	},
	"P210E": {
		"zzs": "Alle autofabrikanten",
		"dm": "P210E",
		"des": "Throttle/pedaalpositiesensor/schakelaar C/F-spanningscorrelatie",
		"sys": "Brandstof-, lucht- of emissieregeling",
		"zs": "In het elektronische gasklepbedieningssysteem (ETC) is de rol van de gaspedaalpositiesensor (APP) het doorgeven van de stand van het gaspedaal aan de gasklepregelmodule in de vorm van een elektrisch signaal, als een gasklepactuator om de gasklep te regelen Referentiebasis voor klepopening."
	},
	"P2465": {
		"zzs": "Alle autofabrikanten",
		"dm": "P2465",
		"des": "Drukverschil roetfilter te hoog (Bank 2)",
		"sys": "Emissiecontrole",
		"zs": "De functie van het dieselroetfilter (DPF) is het verwijderen van verontreinigende deeltjes en roet uit de dieseluitlaat. Dieselroetfilter (DPF) is over het algemeen verdeeld in twee typen: hernieuwbaar en niet-hernieuwbaar. Vernieuwbaar roetfilter Over het algemeen is de filter wordt geregenereerd door hoge temperatuur of door deeltjes te oxideren met stikstofoxiden.De rol van de dieselroetfilter (DPF) druksensor is om schade aan de motor te voorkomen als gevolg van overmatige druk veroorzaakt door de verstopping van het roetfilter, en aan de roetfilter filter. Regeneratie zorgt voor diagnose."
	},
	"P2059": {
		"zzs": "Alle autofabrikanten",
		"dm": "P2059",
		"des": "Reductant Injectie Luchtpomp Regelcircuit/Open",
		"sys": "Brandstof-, lucht- of emissieregeling",
		"zs": "Diesel Exhaust Fluid (DEF), ook wel reductiemiddel genoemd, is een mengsel van 32,5% ureum en water. Wanneer het in de uitlaat wordt geïnjecteerd, kan het stikstofoxiden omzetten in onschadelijk stikstof en water. Reductie De pomp van het middel assemblage bevat een drukpomp, een druksensor, een ontluchtingsklep, een uitlaatfilter en een intern verwarmingselement.De rol van de reductantdruksensor is om de pompsnelheid voor de PCM te regelen door middel van pulsbreedtemodulatie (PCM), waardoor de systeemdruk om feedback te geven. Wanneer de PCM om reductantinjectie vraagt, gaat de reductantinjector open en draait de pomp, waardoor druk wordt uitgeoefend op de oorspronkelijke drukleiding en injectoren en lucht uit het systeem wordt verwijderd. Wanneer alle lucht is verwijderd, wordt brandstof geïnjecteerd. De pomp wordt uitgeschakeld en de pomp levert een druk van ongeveer 500 kPa ter voorbereiding op de injectie van het reductiemiddel."
	},
	"P2315": {
		"zzs": "Alle autofabrikanten",
		"dm": "P2315",
		"des": "Bobine F primair regelcircuit laag",
		"sys": "Ontstekingssysteem",
		"zs": "De rol van de bobine is om de 12-volt spanning van de accu van de auto om te zetten in duizenden of zelfs tienduizenden volt die nodig is voor het ontsteken van de bougie. Er zijn twee sets spoelen in de bobine, de primaire spoel en de secundaire spoel. De primaire spoel heeft een dikkere geëmailleerde draad met minder windingen; de secundaire spoel gebruikt een dunnere geëmailleerde draad, die relatief meer windingen heeft. Wanneer de primaire spoel wordt ingeschakeld, wordt er een sterk magnetisch veld omheen gegenereerd terwijl de stroom neemt toe en de ijzeren kern slaat magnetische veldenergie op; wanneer het schakelapparaat het primaire spoelcircuit opent, vervalt het magnetische veld van de primaire spoel snel en wordt een hoge spanning geïnduceerd in de secundaire spoel."
	},
