		"sys": "Ontstekingssysteem",
		"zs": "De aandrijflijncontrolemodule (PCM) gebruikt een pingelsensor om trillingen te detecteren wanneer het motortoerental verandert. De pingelsensor drukt deze trilling vervolgens uit als een spanning. De elektronische regelmodule (ECU) reageert indien nodig Vermijd kloppen door vertragende ontsteking, enz."
