		"sys": "Versnellingsbak",
		"zs": "De functie van de transmissievloeistofkoeler is om de temperatuur van de transmissievloeistof te verlagen om te voorkomen dat de transmissievloeistof verslechtert als gevolg van te hoge temperaturen wanneer het voertuig onder hoge belasting rijdt."
