		"zs": "De functie van het koppelbeheersysteem is om het koppel van de motor te verminderen door de brandstofinjector tijdelijk te sluiten of de ontsteking te vertragen tijdens het schakelen van de transmissie of het slippen van de wielen, om het schakelen soepeler te laten verlopen en de slijtage van de aandrijflijn."
