		"des": "Verdampingsemissiesysteem lekdetectie pompdetectie circuit hoog",
		"sys": "Emissiecontrole",
		"zs": "Het verdampingsemissiesysteem (EVAP) leidt benzinedampen van de brandstoftank naar een opslagtank met geactiveerde koolstof die benzinedampen absorbeert. De motor gebruikt vervolgens verse lucht om deze benzinedampen in de verbrandingskamer van de motor te spoelen. Lekken De De functie van de diagnosemodule is om een kleine hoeveelheid druk uit te oefenen op het verdampingsemissiesysteem (EVAP) en het brandstofsysteem met behulp van de lekdetectiepomp (LDP), en vervolgens het systeem te detecteren op lekken om ervoor te zorgen dat er geen schadelijke dampen ontsnappen in de atmosfeer."
