		"des": "Vuldruk turbocompressor/supercharger te hoog - mechanisch",
		"sys": "Brandstof-, lucht- of emissieregeling",
		"zs": "De turbocompressor gebruikt het traagheidsmomentum van het uitlaatgas dat uit de motor komt om de turbine aan te drijven, die op zijn beurt de coaxiale waaier aandrijft om de inlaatlucht onder druk te zetten, waardoor het vermogen van de auto toeneemt. De supercharger is een supercharger gebruikt om het vermogen van de verbrandingsmotor te vergroten. Inlaatluchtcompressor. Meer inlaatlucht zorgt voor meer zuurstof naar de motor, waardoor de regeleenheid meer brandstof kan leveren, wat het vermogen verhoogt. "
