		"des": "Reductantdruksensor circuit hoog",
		"sys": "Brandstof-, lucht- of emissieregeling",
		"zs": "Diesel Exhaust Fluid (DEF), ook wel reductiemiddel genoemd, is een mengsel van 32,5% ureum en water. Wanneer het in de uitlaat wordt geïnjecteerd, kan het stikstofoxiden omzetten in onschadelijk stikstof en water. Vermindering van de middeldruk sensor is over het algemeen geïntegreerd met de reductiemiddelpomp. Zijn rol is om feedback te geven aan de PCM om de pompsnelheid te regelen door middel van pulsbreedtemodulatie (PCM), waardoor de systeemdruk wordt geregeld. "
