	"P2564": {
		"zzs": "Alle autofabrikanten",
		"dm": "P2564",
		"des": "Turbocompressor Boostregeling Positiesensor A Circuit laag",
		"sys": "Aux-ingang",
		"zs": "De turbocompressor gebruikt het traagheidsmomentum van het uitlaatgas dat uit de motor komt om de turbine voort te stuwen, en de turbine drijft de coaxiale waaier aan om de inlaatlucht te stimuleren, waardoor het vermogen van het voertuig toeneemt. De turbo/supercharger-boost controller De functie is dat wanneer de boostdruk de ingestelde waarde bereikt, de luchtdruk de wastegate-actuator (pneumatisch-mechanisch type) duwt om een deel van het uitlaatgas van de turbine te omzeilen, waardoor de turbinesnelheid wordt verlaagd en het boostniveau wordt geregeld. boost control position sensor De rol is om de positie van de wastegate-klep te bewaken."
	},
