		"dm": "P2070",
		"des": "Inlaatspruitstukafstemming (IMT) klep zit open (bank 1)",
		"sys": "Brandstof-, lucht- of emissieregeling",
		"zs": "Als de lengte van de doorlaat van het inlaatspruitstuk (runner) optimaal is, zal de drukgolf die wordt gegenereerd door het sluiten van de klep helpen om het olie-luchtmengsel in de motor te leiden. Het probleem is dat de optimale doorlaat van het inlaatspruitstuk voor verschillende motortoerentallen is ook anders.De functie van de spruitstukafstemklep (MTV) is om de inlaatlucht in de doorgangen van het inlaatspruitstuk van verschillende lengtes te leiden, afhankelijk van het motortoerental, om het koppel van de motor bij verschillende snelheden te optimaliseren De oorzaken van de storing zijn onder meer kortsluiting van het signaalcircuit van het inlaatspruitstuk (IMT) naar aarde, storing van de IMRC-actuator, storing van de elektronische regelmodule (PCM of ECM), enz."
