		"dm": "P2476",
		"des": "Uitlaatgastemperatuursensor circuit hoog (bank 2 sensor 4)",
		"sys": "Emissiecontrole",
		"zs": "De functie van de uitlaatgastemperatuursensor is om de uitlaatgastemperatuur in de vorm van een elektrisch signaal naar de elektronische regeleenheid (ECU) te sturen. De uitlaatgastemperatuur die wordt gegenereerd door de juiste lucht-brandstofverhouding is hoger dan de uitlaatgastemperatuur die wordt gegenereerd door de te rijke of te arme lucht-brandstofverhouding. Lage luchttemperatuur. Een te hoge uitlaattemperatuur (>160°C) kan de motor beschadigen."
