		"zs": "In het elektronische gasklepbedieningssysteem (ETC) is de rol van de gaspedaalpositiesensor (APP) het doorgeven van de stand van het gaspedaal aan de gasklepregelmodule in de vorm van een elektrisch signaal, als een gasklepactuator om de gasklep te regelen Referentiebasis voor het openen van de klep.De gasklepactuator is een stappenmotor, die verantwoordelijk is voor het regelen van de opening van de gasklep volgens de instructies van de gasregelmodule.De oorzaak van de fout omvat de elektronische besturing module (PCM of ECM) defect. Het wordt aanbevolen om de fout te wissen. Als dezelfde foutcode opnieuw verschijnt, moet de elektronische regelmodule worden vervangen."
