		"des": "Throttle Actuator Besturingssysteem - Geforceerd beperkt vermogen",
		"sys": "Brandstof-, lucht- of emissieregeling",
		"zs": "In het elektronische gasklepbedieningssysteem (ETC) is de rol van de gaspedaalpositiesensor (APP) het doorgeven van de stand van het gaspedaal aan de gasklepregelmodule in de vorm van een elektrisch signaal, als een gasklepactuator om de gasklep te regelen Referentiebasis voor het openen van de klep.De gasklepactuator is een stappenmotor, die verantwoordelijk is voor het regelen van de opening van de gasklep volgens de instructies van de gasregelmodule.Als de elektronische regelmodule detecteert dat het werkt in Failed Mode Effects Management (FMEM)-modus Wanneer het systeem van de gasklepactuatorbesturingsmotor (TACM) zich in de geforceerde beperkte vermogensmodus bevindt, verschijnt deze foutcode. De oorzaken van de fout zijn onder meer TACM-circuit- of connectorstoring, elektronische regelmodule ( PCM of ECM) storing, etc."
