		"sys": "Brandstof-, lucht- of emissieregeling",
		"zs": "De gasklep, algemeen bekend als de gasklep, is een bestuurbare klep die wordt gebruikt om het inlaatluchtvolume van de motor te regelen. De functie van de gasklepstandsensor (TP) is om de gasklepopening door te geven in de vorm van een elektrisch signaal naar de elektronische regeleenheid (ECU), als een van de basisparameters voor het regelen van de brandstofinjectie van de motor."
