		"zs": "Het verdampingsemissiesysteem (EVAP) leidt benzinedampen van de brandstoftank naar een opslagtank met actieve kool die benzinedampen absorbeert. De motor gebruikt vervolgens frisse lucht om deze benzinedampen in de verbrandingskamer van de motor te spoelen."
