		"dm": "P2071",
		"des": "Intake Manifold Tuning (IMT) Klep Vast Gesloten (Bank 1)",
		"sys": "Brandstof-, lucht- of emissieregeling",
		"zs": "Als de lengte van de doorlaat van het inlaatspruitstuk (runner) optimaal is, zal de drukgolf die wordt gegenereerd door het sluiten van de klep helpen om het olie-luchtmengsel in de motor te leiden. Het probleem is dat de optimale doorlaat van het inlaatspruitstuk voor verschillende motortoerentallen is ook anders.De rol van de afstemklep van het inlaatspruitstuk (IMTV) is om de inlaatlucht naar de doorgangen van het inlaatspruitstuk van verschillende lengtes te leiden, afhankelijk van het motortoerental, om het koppel van de motor bij verschillende toerentallen te optimaliseren snelheden. De oorzaak van de storing omvat het open circuit van het IMTV-signaalcircuit, het open circuit van het IMT-voedingscircuit, de storing van de IMTV-actuator, de storing van de elektronische besturingsmodule (PCM of ECM), enz."
