		"sys": "Brandstof-, lucht- of emissieregeling",
		"zs": "In een Electronic Throttle Control (ETC)-systeem is de gasklepactuator een stappenmotor, die verantwoordelijk is voor het regelen van het openen van de gasklep volgens de instructies van de gasklepregelmodule."
