	"P20C7": {
		"zzs": "Alle autofabrikanten",
		"dm": "P20C7",
		"des": "Reductantverwarming D Regelcircuit laag",
		"sys": "Brandstof-, lucht- of emissieregeling",
		"zs": "Diesel Exhaust Fluid (DEF), ook wel reductiemiddel genoemd, is een mengsel van 32,5% ureum en water. Wanneer het in de uitlaat wordt geïnjecteerd, kan het stikstofoxiden omzetten in onschadelijk stikstof en water. Reductie De functie van de middelverwarmer is om het reductiemiddel in een vloeibare toestand te houden wanneer de buitentemperatuur erg laag is.Wanneer de reductiemiddeltemperatuursensor detecteert dat de temperatuur van de dieseluitlaatvloeistof (DEF) daalt tot de vriestemperatuur (-11 graden Celsius), de aandrijflijn De regelmodule (PCM) instrueert vervolgens de regelmodule van de gloeibougie om de reductantverwarming te activeren."
	},
