		"sys": "Versnellingsbak",
		"zs": "Het belangrijkste onderdeel van de transmissie bestaat uit een planetair tandwielsysteem op een tussenas. Het is aan het ene uiteinde verbonden met de ingaande as en aan het andere uiteinde met de uitgaande as."
