		"sys": "Brandstof-, lucht- of emissieregeling",
		"zs": "De rol van het uitlaatgasrecirculatiesysteem (EGR) is om een kleine hoeveelheid uitlaatgas in het inlaatspruitstuk te leiden wanneer de motor onder hoge belasting draait. De aanwezigheid van deze uitlaatgassen verlaagt de temperatuur en druk van de verbrandingskamer, waardoor de uitstoot van stikstofoxide wordt verminderd."
