	"P2197": {
		"zzs": "Alle autofabrikanten",
		"dm": "P2197",
		"des": "O2-sensorsignaal vertekend/vastgelopen (bank 2 sensor 1)",
		"sys": "Brandstof-, lucht- of emissieregeling",
		"zs": "De functie van de zuurstofsensor is om het zuurstofgehalte in het uitlaatgas van de motor te meten om de hoeveelheid brandstofinjectie te corrigeren, zodat de motor de beste lucht-brandstofverhouding kan verkrijgen. In de OBD-foutcode, u zult vaak het aantal rijen en nummers zien Zuurstofsensor Rij 1 verwijst naar de rij waar cilinder 1 zich bevindt, en de resterende rij is rij 2. Ongeacht welke rij, de eerste sensor verwijst altijd naar de stroomopwaartse zuurstofsensor (vóór de katalytische tank), de 2e sensor verwijst altijd naar de stroomafwaartse zuurstofsensor (na de katalytische tank). De oorzaken van storing zijn onder meer luchtlekkage na de inlaatluchtstroom (MAF) -sensor, PCV-systeemlekkage, motorvacuümlekkage, oliepeilstok, basismotor Storingen (oliepeil te hoog, verkeerde nokkenastiming, cilindercompressie te laag, uitlaat lekt voor zuurstofsensor), problemen met EGR-systeem (EGR-klep blijft openstaan, lekt enz.), problemen met het brandstofsysteem (defecte brandstofdrukregelaar of de brandstofdruk is te laag), de connector van het circuit van de zuurstofsensor of zelf is defect, enz."
	},
	"P2021": {
		"zzs": "Alle autofabrikanten",
		"dm": "P2021",
		"des": "Inlaatspruitstuk Runner Positie Sensor/Schakelaar Circuit Laag (Bank 2)",
		"sys": "Brandstof-, lucht- of emissieregeling",
		"zs": "De inlaatspruitstukdoorgangscontrole (IMRC)-constructie bevindt zich tussen het inlaatspruitstuk en de cilinderkop. Om de motorprestaties te verbeteren, komt elke cilinder overeen met twee inlaatdoorgangen, waarvan er één altijd open is en de andere alleen opengaat wanneer de snelheid hoger is dan een bepaalde waarde (zeg 3000 RPM). De rol van de doorgangspositiesensor van het inlaatspruitstuk is om de opening van de doorgangsklep door te geven aan de elektronische regeleenheid (ECU) in de vorm van een elektrisch signaal. "
	},
