	"P2708": {
		"zzs": "Alle autofabrikanten",
		"dm": "P2708",
		"des": "Schakelsolenoïde F zit vast",
		"sys": "Versnellingsbak",
		"zs": "De schakelsolenoïdeklep regelt de hydraulische druk naar de transmissiekoppeling door de transmissievloeistofregelklep te openen of te sluiten om de ontkoppeling en inschakeling voor schakelen te regelen. De oorzaken van deze foutcode zijn onder meer dat het transmissievloeistofpeil te hoog is. Laag , transmissievloeistof is te vuil, mechanische storing schakelsolenoïdeklep, storing circuit, connector of transmissieregelmodule (TCM), enz."
	},
	"P2481": {
		"zzs": "Alle autofabrikanten",
		"dm": "P2481",
		"des": "Uitlaatgastemperatuursensor circuit laag (bank 1 sensor 5)",
		"sys": "Emissiecontrole",
		"zs": "De functie van de uitlaatgastemperatuursensor is om de uitlaatgastemperatuur in de vorm van een elektrisch signaal naar de elektronische regeleenheid (ECU) te sturen. De uitlaatgastemperatuur die wordt gegenereerd door de juiste lucht-brandstofverhouding is hoger dan de uitlaatgastemperatuur die wordt gegenereerd door de te rijke of te arme lucht-brandstofverhouding. Lage luchttemperatuur. Een te hoge uitlaattemperatuur (>160°C) kan de motor beschadigen."
	},
	"P2275": {
		"zzs": "Alle autofabrikanten",
		"dm": "P2275",
		"des": "O2-sensorsignaal vertekend/vastzittend rijk (bank 1 sensor 3)",
		"sys": "Brandstof-, lucht- of emissieregeling",
		"zs": "De functie van de zuurstofsensor is om het zuurstofgehalte in het uitlaatgas van de motor te meten om de hoeveelheid brandstofinjectie te corrigeren, zodat de motor de beste lucht-brandstofverhouding kan verkrijgen. In de OBD-foutcode, u zult vaak het aantal rijen en nummers zien Zuurstofsensor Rij 1 verwijst naar de rij waar cilinder 1 zich bevindt, en de resterende rij is rij 2. Ongeacht welke rij, de eerste sensor verwijst altijd naar de stroomopwaartse zuurstofsensor (vóór de katalytische tank), De tweede sensor is altijd de stroomafwaartse zuurstofsensor (na de katalytische tank)."
	},
	"P20D2": {
		"zzs": "Alle autofabrikanten",
		"dm": "P20D2",
		"des": "Uitlaat Nabehandeling Brandstof Injector B Controle Prestaties",
		"sys": "Brandstof-, lucht- of emissieregeling",
		"zs": "Wanneer de temperatuur van het dieseluitlaatsysteem hoog genoeg is, kan het roetfilter (DPF) passief worden geregenereerd (door de koolstofafzettingen op het filter te oxideren). Wanneer de temperatuur van het uitlaatsysteem niet hoog genoeg is, het kan actieve DPF-regeneratie doorstaan door een kleine hoeveelheid brandstof stroomopwaarts van de dieseloxidatiekatalysator (DOC) te injecteren om de temperatuur van het uitlaatsysteem te verhogen. Merk op dat deze geïnjecteerde brandstof niet verbrandt in het uitlaatsysteem. "
	},
	"P222D": {
		"zzs": "Alle autofabrikanten",
		"dm": "P222D",
		"des": "Luchtdruksensor B circuit hoog",
		"sys": "Brandstof-, lucht- of emissieregeling",
		"zs": "De rol van de luchtdruksensor (soms de High Altitude Compensator, HAC genoemd) is om de luchtdruk als een elektrisch signaal naar de elektronische regelmodule te sturen. De luchtdruk varieert met het weer en de hoogte. Hoe lager de druk , hoe armer de lucht. De Powertrain Control Module (PCM) past de brandstoftoevoer aan op basis van de luchtdrukwaarde om de motor te helpen de optimale lucht-brandstofverhouding te bereiken."
	},
