		"dm": "P2013",
		"des": "Inlaatspruitstuk runner regelcircuit hoog (bank 2)",
		"sys": "Brandstof-, lucht- of emissieregeling",
		"zs": "De inlaatspruitstukdoorgangscontrole (IMRC)-constructie bevindt zich tussen het inlaatspruitstuk en de cilinderkop. Om de motorprestaties te verbeteren, komt elke cilinder overeen met twee inlaatdoorgangen, waarvan er één altijd open is en de andere alleen opengaat wanneer de snelheid boven een bepaalde waarde ligt (zeg 3000 RPM). De rol van de IMRC-uitvoeringsmotor is het openen/sluiten van de klepklep van de inlaatdoorgang volgens het commando van de elektronische regeleenheid (ECU)."
