		"sys": "Brandstof-, lucht- of emissieregeling",
		"zs": "In het elektronische gasklepbedieningssysteem (ETC) is de rol van de gaspedaalpositiesensor (APP) het doorgeven van de stand van het gaspedaal aan de gasklepregelmodule in de vorm van een elektrisch signaal, als een gasklepactuator om de gasklep te regelen Referentiebasis voor het openen van de klep.De gasklepactuator is een stappenmotor, die verantwoordelijk is voor het regelen van de opening van de gasklep volgens de instructies van de gasklepregelmodule.Deze foutcode geeft aan dat de elektronische regelmodule detecteert dat de gasklepactuator de motor regelt (TACM) circuitspanning is buiten het normale bereik. Storingsoorzaken zijn onder meer Throttle Actuator Control Motor (TACM) circuit- of connectorfout, TACM-assemblagefout, elektronische besturingsmodule (PCM of ECM) fout, etc. "
