		"sys": "Aandrijflijnsysteem (gedefinieerd door de fabrikant)",
		"zs": "De rol van de nokkenas is het regelen van het openen en sluiten van de klep. In het variabele kleptimingsysteem verandert de elektronische nokkenasregelklep (of olieregelklep, OCV) de De hoek van de nokkenas wordt aangepast door middel van oliedruk naar de nokkenasversteller (mechanisch) om ervoor te zorgen dat de klep op het optimale moment opent en sluit.De rol van de nokkenaspositie (CMP) sensor is het aanpassen van de nokkenaspositie (de relatieve positie) wordt doorgegeven aan de Electronic Control Unit (ECU) in de vorm van een spanningssignaal."
