		"zs": "Controller Area Network (CAN) (afgekort CAN of CAN-bus) is een communicatieprotocol voor auto's, dat wordt gekenmerkt doordat apparaten op het netwerk rechtstreeks met elkaar kunnen communiceren, zonder dat er een host nodig is om de communicatie te regelen op het netwerk."
