		"sys": "Aandrijflijnsysteem (gedefinieerd door de fabrikant)",
		"zs": "Het werkingsprincipe van het startrelais (solenoïdeklep) is dat wanneer de contactschakelaar wordt ingeschakeld, er een kleine stroom door een solenoïdespoel vloeit, waardoor een paar grotere schakelaars worden gecombineerd, waardoor een grote stroom kan vloeien door de motor en start de motor."
