		"zs": "De functie van een dieselroetfilter (DPF) is het verwijderen van verontreinigende deeltjes en roet uit de dieseluitlaat. Dieselroetfilter (DPF) is over het algemeen verdeeld in twee typen: hernieuwbaar en niet-hernieuwbaar. Vernieuwbaar roetfilter Filters zijn doorgaans geregenereerd door hoge temperatuur of door deeltjes te oxideren met stikstofoxiden."
