		"zs": "Voor sommige krachtige auto's, wanneer de belasting erg klein is, is de gasklep bijna gesloten en heeft de motor werk nodig om inlaatlucht te verkrijgen. Op dit moment is de compressiedruk van het mengsel in de cilinder ook erg laag, wat resulteert in een laag rendement. De cilinder is gedeactiveerd. Het systeem bereikt een hoger motorrendement door de in- en uitlaatkleppen van bepaalde cilinders te sluiten."
