		"sys": "Aandrijflijnsysteem (gedefinieerd door de fabrikant)",
		"zs": "De functie van de perifere druksensor is om de atmosferische druk naar de elektronische regelmodule te sturen in de vorm van een elektrisch signaal. De aandrijflijnregelmodule (PCM) is gebaseerd op het verschil tussen de druk in het inlaatspruitstuk en de atmosferische druk (met lineaire motorbelasting) corrigeert de brandstoftoevoer om de motor te helpen de optimale lucht-brandstofverhouding te bereiken bij verschillende belastingen."
