		"sys": "Aandrijflijnsysteem (gedefinieerd door de fabrikant)",
		"zs": "De brandstofdrukregelaar gebruikt een door een veer aangedreven klep om overtollige benzine terug naar de tank te laten stromen, waardoor een constante druk in het brandstofcircuit wordt gehandhaafd. De brandstofdrukregelaar heeft een vacuümleiding die is aangesloten op de inlaat. Zorg voor overeenkomstige benzinedruk onder verschillende motorbedrijfsomstandigheden (motorbelasting beoordelen op basis van de mate van vacuüm).De meeste auto's brandstofdrukregelaars bevinden zich op de brandstofaftakleiding, maar sommige auto's brandstofdrukregelaars bevinden zich in de brandstoftank.De brandstofdruksensor meet de brandstofdruk nabij de injector. De elektronische regeleenheid (ECU) gebruikt dit signaal om de pulsbreedte van de injector aan te passen en de hoeveelheid brandstof te meten die de verbrandingskamer binnenkomt."
