	"U1098": {
		"zzs": "Ford, Mercury, Lincoln",
		"dm": "U1098",
		"des": "CAN-databus, antiblokkeerremsysteem (ABS) - Voertuigsnelheid ongeldige of ontbrekende gegevens",
		"sys": "Netwerkcommunicatiesysteem",
		"zs": "Controller Area Network (CAN) (afgekort CAN of CAN-bus) is een communicatieprotocol voor auto's, dat wordt gekenmerkt doordat apparaten op het netwerk rechtstreeks met elkaar kunnen communiceren, zonder dat er een host nodig is om de communicatie te regelen op het netwerk. De functie van het vergrendelingsremsysteem (ABS) is om te voorkomen dat de wielen blokkeren, zodat de auto nog steeds kan sturen tijdens het remmen, om de stabiliteit van de remrichting van de auto te waarborgen en om zijdelingse slip te voorkomen en afwijking."
	},
	"U1125": {
		"zzs": "mini",
		"dm": "U1125",
		"des": "Besturingsmodule elektronisch stabiliteitsprogramma - Berichtbewaking, zelftest",
		"sys": "Netwerkcommunicatiesysteem",
		"zs": "Het elektronische stabiliteitssysteem integreert ABS (antiblokkeersysteem), BAS (remhulpsysteem) en ASR (acceleratie-antislipcontrolesysteem), drie systemen die krachtiger zijn. Deze groep systemen is meestal het ondersteunt de functies van ABS en ASR (drive antislipsysteem, ook bekend als tractiecontrolesysteem). Het helpt het voertuig om dynamisch evenwicht te behouden door de rijstatusinformatie van het voertuig van verschillende sensoren te analyseren en vervolgens correctiecommando's naar ABS en ASR te sturen. ESP zorgt ervoor dat het voertuig onder alle omstandigheden optimaal stabiel blijft, vooral bij overstuur of onderstuur."
	},
